INSERT INTO `objekat` (`id`, `oznaka`, `tekstNatpisa`, `vrstaNatpisa`, `jezik`, `provincija`, `grad`, `mesto`, `pleme`, `modernaDrzava`, `modernoMesto`, `ustanova`, `pocetakGodina`, `pocetakVek`, `pocetakOdrednica`, `krajGodina`, `krajVek`, `krajOdrednica`, `tip`, `materijal`, `dimenzije`, `komentar`, `faza`, `korisnickoIme`, `datumKreiranja`, `datumPoslednjeIzmene`, `datovano`, `lokalizovano`) VALUES
(55, 'IMS.1.1', 'Dea[m] Hecaten trivi|ae t[r]iformi Val(erius) Cr|escentio mi(les) leg(ionis) IIII Fl(aviae) Ma|x(iminianae) [pro s]e et suis v(otum) p(osuit) l(ibens) m(erito).', 12, 4, 5, 9, -1, -1, 4, 10, 13, NULL, 3, NULL, NULL, NULL, NULL, 'arhitrav', 'beli krecnjak', '26:35:139', 'Posveta Hekati od strane vojnika legije IV Flavia se moze dovesti u vezu sa odlaskom legije u Germaniju ili Dakiju 236 237. godine. Na takvo datovanje upucuje i legijski epitet Maximiniana.', 'zaKontrolu', 'zarko', '2015-11-25', '2015-11-26', 1, 1),
(57, 'IMS.1.2', 'Deo Heroni | collitores ipsius | Theodotus Gude pater | Victorianus  Zinama | Mucianus  Herodes | Valentinus  Hermogenes | Rodo  Iulis | Natus  Hermogenes | Victorinus  Maximinu[s] | Dometianus  Marcus | Septuminus  v(otum) p(osuerunt) l(ibentes) m(erito)', 11, 4, 5, 9, -1, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'supljikavi pescar', '44:100:51', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 0, 1),
(58, 'IMS.1.3', 'I(ovi) O(ptimo) M(aximo) | Cilices | pro salute | d(ominorum) n(ostrorum trium) | po[su]erun[t] | [co]ntirones | [D]extro et Prisco | co(n)s(ulibus).', 11, 4, 5, 9, -1, -1, 4, 10, 15, 196, 2, 'druga polovina', NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '46:99:39', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 1, 1),
(59, 'IMS.1.4', 'I(ovi) O(ptimo) M(aximo) | pro salute | d(omini) n(ostri) Sev[e]ri Ale|xandri Aug(usti) | Cl(audius) Lupercu|s mil(es) leg(ionis) | IIII Fl(aviae) S(everianae) A(lexandrianae) ex vo|to posuit l(ibens) m(erito).', 11, 4, 5, 9, -1, -1, 4, 10, 13, 222, 3, 'prva polovina', 235, 3, 'prva polovina', 'zrtvenik', 'krecnjak', '23:60:28', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 1, 1),
(60, 'IMS.1.5', 'I(ovi) O(ptimo) M(aximo) | SNS | Aemilius | Dolens | optio.', 11, 4, 5, 9, -1, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '32:85:37', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 0, 1),
(61, 'IMS.1.6', 'I(ovi) O(ptimo) M(aximo) | Barbius | Ulpian(us) | cornic(ularius) | leg(ionis) IIII F(laviae) f(elicis).', 11, 4, 5, 9, -1, -1, 4, 10, 16, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '28:74:25', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 0, 1),
(62, 'IMS.1.7', 'I(ovi) O(ptimo) M(aximo) | FL () OMN | l(ibens) v(otum) p(osuit).', 11, 4, 5, 9, -1, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'pescar', '26:53:21', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 0, 1),
(63, 'IMS.1.8.', 'I(ovi) O(ptimo) M(aximo) | C. Val(erius) | Secun|[di]nus | [l(ibens) v(otum) s(olvit)].', 11, 4, 5, 9, -1, -1, 4, 10, 17, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '39:62:31', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 0, 1),
(64, 'IMS.1.9', 'I(ovi) O(ptimo) M(aximo) | Patern[o] | Aur(elis) Mar|cus (centurio) leg(ionis) | IIII Fl(aviae) Galli|ene () ex v(oto) p(osuit).', 11, 4, 5, 9, -1, -1, 4, 10, 13, 257, 3, 'druga polovina', 300, 3, 'prva polovina', 'oltar', 'krecnjak', '52:124:68', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 1, 1),
(65, 'IMS.1.10', 'I(ovi) O(ptimo) M(aximo) P(aterno) | Aur(elius) Cres|cens | v(otum) p(osuit) l(ibens) m(erito) Pro|bo co(n)s(ule).', 11, 4, 5, 9, -1, -1, 4, 10, 18, 277, 3, 'druga polovina', NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '34:71:32', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 1, 1),
(66, 'IMS.1.11', 'I(ovi) O(ptimo) M(aximo) P(aterno) | Aur(elius) Cre|scentio | lap[i]dariu()|s pro salut|e sua | et suorum.', 11, 4, 5, 9, -1, -1, 4, 10, 18, NULL, 3, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '::', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 1, 1),
(68, 'IMS.1.12', 'I(ovi) O(ptimo) M(aximo) | Pater(no) | Aur(elius( Iuli|anus m(iles) | l(ibens) p(osuit) m(erito).', 11, 4, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '::', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 0, 1),
(69, 'IMS.1.13', 'I(ovi) O(ptimo) M(aximo) Pa(terno) | T. Aur(elius) L() [.] |nus ex v|oto pos|uit.', 11, 4, 5, 9, -1, -1, 4, 10, 15, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '29:60:27', '', 'zaKontrolu', 'sara', '2015-11-25', '2015-11-27', 0, 1),
(70, 'IMS.1.14', 'M. Iovi votum | [A]elius Marcus | Apamenus | s(onum) d(edit).', 11, 4, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'urna', '', '::', 'Dedikantov origo Apamenus najverovatnije upucuje na maloazijsku Apameju gde je posvedoceno regrutovanje za legiju IV Flavia.', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 0, 1),
(71, 'IMS.1.15', 'I(ovi) O(ptimo) M(aximo) | Iunoniq(ue) Miner(vae) | P. Terentius | Aquilinus et | Tretenica () Sabina | consis(s)tentes Aqu|ileiae | v(otum) s(olverunt) l(ibentes) m(erito).', 11, 4, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'beli mermer', '28:70:61', '', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 0, 1),
