(74, 'IMS.1.18', 'Ael(ius) Valentinu[s', 11, 4, 5, 9, -1, -1, 4, 10, 16, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'mermer', '1:14:12', 'Dve mermerne ploce sa predstavom Mitre koji nosi bika na prvoj i istog bozanstva koji jase bika na drugoj ploci jedini su tragovi Mitrinog kulta u Singidunumu. Svetiliste u Donjem gradu najverovatnije je pripadalo legiji IV Flavia.', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 0, 1),
(75, 'IMS.1.19', 'Nemesi | Aug(ustae) | Auf(idius) Ing[e]|nuus opt[io] | D P () [', 11, 4, 5, 9, -1, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '30:58:30', 'Boginja Nemeza se smatra zastitnicom javnih igara i brutalnih borbi i dovodi se u vezu sa vojnim logorom. Dva oltara posvecena Nemezi Regini od strane beneficijarnih konzulara legije IV Flavia pronadjena su u Kosovskoj Mitrovici.', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 0, 1),
(76, 'IMS.1.20', 'Deae  Orciae sacrum | pro salute d(ominorum) n(ostrorum duorum) Diocletiani et | Maximiani Aug(ustorum duorum) | ordo am(plissimus) s(plendidissimae) col(oniae) Sing(iduni) per| M(arcos) Aur(elios) Cutiam et Sosonem | II viros curante Sim|plicio v(ivo) e(gregio) d(ominis) n(ostris) | Deiocletiano () III et Ma[x]imi|ano Aug(ustis) co(n)s(ulibis).', 11, 4, 5, 9, -1, -1, 4, 10, 13, 287, 3, 'druga polovina', NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '36:115:60', 'Ovaj spomenik predstavlja najranije svedocanstvo o kolonijalnom statusu Singidunuma.', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 1, 1),
