(80, 'IMS.1.24', 'Imp(eratori) Caesari | M. Antonio | Gordiano | Pio Felici In|victo Aug(usto) | leg(io) IIII F[l(avia) fe]l(ix) | Gordiana | devota numi|ni maiestati|que eius.', 14, 4, 5, 9, -1, -1, 4, 10, 19, 242, 3, 'prva polovina', NULL, NULL, NULL, 'zrtvenik', '', '::', 'Podizanje spomenika Gordijanu III moze se dovesti u vezu sa carevim prolaskom kroz provinciju Meziju SHA vita Gord. 26.3 u prolece 242. godine. Iz iste godine je i natpis iz Ravne  takodje posvecen caru Gordijanu III od strane kohorte II Aurelia Dardanorum Gordiana.', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 1, 1),
(81, 'IMS.1.25', '] | P. Ael(ius) Ca[5] | M. Aur(elius) Severinu[s] | b(ene)f(iciarii) co(n)s(ularis) leg(ionis) I[I] | Adi(utricis) p(iae) f(idelis) v(otum) s(olverunt) l(ibentes) m(erito) | Praesente [e]t Ex[tricato co(n)s(ulibus)].', 11, 4, 5, 9, -1, -1, 4, 10, 13, 217, 3, 'prva polovina', NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '44:45:44', 'Spomenik je znacajan za datovanje povratka legije II Adiutrix sa Istoka za sta se ranije smatralo da se desilo godinu ili dve kasnije up. Ritterling RE XII 19924 col. 1321.', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 1, 1),
(82, 'IMS.1.26', 'D(is) [M(anibus)] | T. [F]l(avio) T. f(ilio) Quirina Vict[orino d]onis donatum () hastis fa[leris corona] m[u]|rali et T. Fl(avio) Victori[ano fili]o eius | et Flaviae Victori[nae optim]ae pu|ellae Spedia Mate|rna ......]ATA fe|mina marito kar[issimo et] filiis | dulcissimis vo[va fecit].', 13, 4, 5, 9, -1, -1, 4, 10, 19, NULL, 2, NULL, NULL, NULL, NULL, 'stela', '', '::', 'Filijacija i triba se retko javljaju na srednjopodunavskim natpisima posle II veka sto potvrdjuje Momzenovo misljenje da spomenik treba datovati u II vek. Flavije Viktorin je mogao biti odlikovan vojnim pocastima u vreme Trajanovog dackog rata. Up. misljenje Domasevskog da natpis treba datovati u doba Severa.', 'zaKontrolu', 'sara', '2015-11-26', '2015-11-27', 1, 1),
