(103, 'IMS.1.35', 'D(is) M(anibus) | Larsina In|genua vixit | annis XXXX P. Ae(lius) | Dionysius ve(teranus) | le(gionis) IIII F(laviae) f(elicis) ex si(gnifero) co|niugi bene | merenti pos(uit).', 13, 4, 5, 9, -1, -1, 4, 10, 13, NULL, 3, NULL, NULL, NULL, NULL, 'stela', 'krecnjak', '30:230:100', 'Iako je skracenica IIII F F bila karakteristicna za epohu koja je prethodia Hadrijanovoj vladi ovaj spomenik najverovatnije nije stariji od druge polovine II veka. Na taj zakljucak upucuju dimenzije i oblik spomenika netipicni za raniji period', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 1, 1),
