(109, 'IMS.1.41', 'D(is) I(nfernis) M(anibus) s(acrum) | Aur(elius) Victor vet(eranus) et Aur(elia) | Victoria coniuges | vivi sibi posuerunt | titulo suo () et Aure[lio] | Alpino () patri genitiv[o] | qui vixit ann(is)  XC | et P. Aur(elio) A[lu]mn(o) () | qui vix[it] ann(is) [.. ] | et Au[r]el(io) [A]pro () v(ixit) an(nis) [.. ] | [..] CE[.]FIA ET ICUS () | annonario posuit.', 13, 4, 5, 9, -1, -1, 4, 10, 13, NULL, 4, NULL, NULL, NULL, NULL, 'stela', 'pescar', '28:225:92', 'Iako bi se na osnovu paleografskih karakteristika spomenik mogao datovati u kraj III i pocetak IV veka termin annonarius ukazuje na IV vek.', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 1, 1),
(110, 'IMS.1.42', 'D(is) M(anibus) | Valeria Apphion | vixit ann(is) II m(ensibus) VIII | C. Vale(erius) Valens vet(eranus) | leg(ionis) IIII [F]l(aviae) et Vale(ria) | Elpis parentes | filiae carissima[e |', 13, 4, 5, 9, -1, -1, 4, 10, 16, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'krecnjak', '19:96:94', 'Porodica koja se javlja na natpisu najverovatnije potice iz Male Azije na sta upucuju ime Apphion i nacin dekoracije spomenika.', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 0, 1),
