(112, 'IMS.1.44', '] [...]rior dec(urio) mun(icipii) Sin(giduni) | vix(it) ann(is) XXV et | C(ais) Ca[s]siis Verae | vixit annis XIII | et Firmo vixit | annis IIII filiis | eorum Cassia | Firma filia he|res parentibus | b(ene) m(erentibus) p(osuit).', 13, 4, 5, 9, -1, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'krecnjak', '27:112:110', '', 'zaKontrolu', 'sara', '2015-11-27', '2016-09-22', 0, 1),
(113, 'IMS.1.45', 'Dibus Manibus | Infernis Nun|nio Prisciano | dec(urioni) col(oniae) Sing(iduni) qui | vixit ann(is) XXXVI | non dignus | cilerius () inf|ra decessit | Aur(elius) Priscillianus | et Sept(imia) Lupercilla', 13, 4, 5, 9, -1, -1, 4, 10, 13, NULL, 3, NULL, NULL, NULL, NULL, 'stela', 'pescar', '29:215:81', 'Singidunum je stekao kolonijalni status u III veku u vremenu izmedju vlade Septimija Severa kada je grad poslednji put potvrdjen kao municipijum i vlade Dioklecijana kada se prvi put pominje colonia Singidunum. Da spomenik treba datovati u vreme posle druge polovine III veka potvrdjuju i formula Dibus Manibus kao i izraz non dignus infra decessit.', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 1, 1),
(114, 'IMS.1.46', 'Vo[lcan]o () [e]t ... et [V]al(erius) Varius II viri et A[u]r(elii) ... la et Maximinus [a]edil(es) et Aur(elii) Mucianus et Ingenianus [q(uaes)]t(ores) Queto et Veldemiano cos.', 11, 4, 5, 9, -1, -1, 4, 10, 19, 272, 3, 'druga polovina', NULL, NULL, NULL, 'zrtvenik', '', '::', 'Spomenik se datuje na osnovu pomena dvojice konzula iz 272. godine Quietus i Veldumnianus.', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 1, 1),
(115, 'IMS.1.47', '[D(is) M(anibus)] M. Ulp(io) Ploto [vix(it) a]nn(os) | V dies LVII | M. Ulp(ius) Trophim(us) aug(ustalis) | et o(ornatus) o(rnamentis) dec(urionalibus) m(unicipi) Sing(iduni) [et] | Claudia Valentina filio.', 13, 4, 5, 9, -1, -1, 4, 10, 13, NULL, 2, NULL, NULL, NULL, NULL, 'sarkofag', 'meki pescar', '10:150:60', 'Marko Ulpije Trofim je mogao biti najverovatnije carski oslobodjenik koji je slobodu i rimsko gradjansko pravo stekao pod Trajanom.', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 1, 1),
(116, 'IMS.1.48', 'Alma lavacrorum da sax[is deci]do lympha | Et sunt ex lapide perfectae [piscina]e pulchrae | Laetis inque locis natus [lacus. Quae] tamen ipsi | Tunc cum sospes erat coniux [sacravit] in usum | Emeritis quondam Alexandr[i] [2 3] nomine dignae. | Raucisoni lapidoso cadunt [de fon]te () liquores |Tam laudati operis dominus [veteranus] et auctor | In suae memoriam voluit con[secrare] maritae. | Ut tamen et lector nomen [cognosce]re possis | Singulae declarant exordia l[itter]ae primae | Aelia cum Tertia subole de coniuge [casta].', 12, 4, 5, 9, -1, -1, 4, 10, 19, NULL, 3, NULL, NULL, NULL, NULL, 'epigram', 'mermer', '::', 'Stihovi na mermernoj ploci su u heksametru.', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 1, 1),
(117, 'IMS.1.49', 'D(is) [M(anibus)] | Quisqi[is iter carpis] | haec ques[o () disce via]|tor ora pue[lli sparsa ge]|nas languin[e barbae] | prime () cuillula c[um tri]|eteride quinta sur[pit et | rapuit misero sola[men] | patri. Hic situs est. Fl[os ut] | moli teluris () aratro sic [patri]|oq(ue) ab amplexu vulsus [fuit. At]|at flosculus arvi[s crescet] | [d]ulcis perexin () te pusum () l() [5]', 13, 4, 5, 9, -1, -1, 4, 10, 13, NULL, 3, NULL, NULL, NULL, NULL, 'epigram', 'krecnjak', '10:92:72', 'Dusanic dopusta i nesto ranije datovanje epigrama u kraj II veka ili pocetak III.', 'zaKontrolu', 'sara', '2015-11-27', '2015-11-27', 1, 1),
