(139, 'IMS.1.76', 'D(is) M(anibus) | Cl(audius) Valentia|nus eq(ues) R(omanus) d(ecurio) IIII M A P | Aur(eliae) Probille c(oniugi) c(arissimae) | q(uae) vixit annos | XVIIII b(ene) m(erenti) p(osuit)', 13, 5, 5, 9, -1, -1, 4, 10, 34, NULL, NULL, NULL, NULL, NULL, NULL, 'Sarkofag', 'pescar', '17:225:74', 'Pronadjen u Zelezniku uz jedan zid sa keramikom i novcem iy vremena Domicijana, Gete i Konstantina.  Epigrafsko polje dimenzija 95 sa 54 cm. IIII (vir) m(unicipi) Ap(ulensis)', 'nekompletno', 'sara', '2015-11-28', '2015-11-28', 0, 1),
(140, 'IMS.1.69', '1  [pec(unia)] sua [f]ec(it)                                                                                                                                                                                                                             2  [fi]lio', 13, 4, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'krecnjak', '14:25:37', 'Fragmenat stele otkriven je u Beogradu oko 1900. godine i nalazio se u lapidariju Muzeja u Beogradu.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(141, 'IMS.1.73', 'CAIS | sace|rd(os)', 14, 5, 5, 9, -1, -1, 4, 10, 34, NULL, NULL, NULL, NULL, NULL, NULL, 'statueta', 'bronza', ':9:5', 'Natpis je uklesan u ovalni stit koji drzi boginja pobede Viktorija sa krilima. Dve supljine na telu Viktorijine statuete mogu znaciti da je figura bila pricvrscenja za neki objekat. CAIS u tekstu natpisa moze se rekonstruisati kao skracenica od Caesaris  Caius Caisius ili od Caisianus.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(142, 'IMS.1.74', 'LUCILI FL VALENTIS PR COR FL', 14, 5, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na kovcegu', 'srebro', '::', 'Natpis se mogao nalaziti na poklopcu od kovcega. Otkriven je u Beogradu pre 1868. godine i nalazio se u Narodnom muzeju odakle je nestao najverovatnije za vreme Prvog svetskog rata. Tekst natpisa se razlicito restituise. Lucili Flavi Valentis primiceri cohortis Flaviae. Safarik.  praepositi cortis Flaviae. Momzen. praefecti cortis Hispanorum. CIL III 8278. PR se moze shvatiti i kao skracenica od protector. Poznat je jedan Flavije Valens protector mozda iz IV veka. CIL VI 32947.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(143, 'IMS.1.77', '1 2  D(is) M(anibus) | Aurel(ius) Valent 4 [v]ixi[t] ann(is) L 8 vixit ann(is) LX 11 16 [..]ius b(ene) m(erenti) p(osuit) | [....] Lucilla | liberorum III | coiux () Aureli | [....] vixit annis | XXX', 13, 5, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik u obliku zrtvenika', '', '60:165:72', 'Spomenik je otkriven u Kumodrazu.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(144, 'IMS.1.78', 'Deo | posuit | M. Ulp(ius) | Thallus.', 11, 5, 5, 9, -1, -1, 4, 10, 31, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '28:73:33', 'Zrtvenik je otkriven u Ritopeku 1940. godine. Najverovatnije je posvecen nekom nerimskom bozanstvu. Imenica deus javlja se na natpisima u Singidunumu uz imena grckog bozanstva Hekate trackih Heroja i keltske ili tracke boginje Orcije. v. IMS I 1 2 20. Deus Andinus javlja se ba batpisu sa teritorije Skupa CIL III 8184. Gentilno ime dedikanta ukazuje na to da spomenik ne moze biti stariji od II veka.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(145, 'IMS.1.79', 'I(ovi) o(ptimo) m(aximo) | pro salute | sua et suo|rum Aurel(ius) | Marcelli|nus V. E. v(otum) p(osuit).', 11, 5, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'beli krecnjak', '38:97:41', 'Spomenik je otkriven u Ritopeku gde se nalazio i u trenutku Vulicevog objavljivanja ovog natpisa 1933. godine. Skracenica V. E. se moze rekonstruisati kao vir egregius. Gentilno ime Aurelius upucuje na drugu polovinu II ili na III vek kao vreme nastanka spomenika.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(146, 'IMS.1.80', 'I(ovi) o(ptimo) m(aximo) pater(mo)|                                                                                                                                                                                                                                                                                           .     .     .     .     .     .     .     .     .     .     .                                                                                                                                                                                                                               .     .     .     .     .     .     .     .     .     .     .                                                                                                                                                                                                                               . . . (centurio) leg(ionis)', 11, 4, 5, 9, -1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '37:98:55', 'Zrtvenik je otkriven u Ritopeku. Centurion koji se javlja na natpisu najverovatnije je bio pripadnik legije IV Flavia.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(147, 'IMS.1.81', 'Aurelius D. . . | vet. leg. | . . . . . . .| sibi vivo | . . . . . . . | . . . . . . . | vix(it) annis . . . . | b(ene) m(erenti)', 13, 4, 5, 9, 1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', '', '33:105:33', 'Spomenik je prepolovljen u visini sestog reda natpisa.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(148, 'IMS.1.82', '. . . . . | . . .s is | . . .  vixit] ann(is) | . . . i]nfe | lici fecit]', 13, 5, 5, 9, 1, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'beli mermer', '03:23:12', 'Otkriveni mali fragmenat mermerne ploce verovatno je bio deo nadgrobnog spomenika na sta bi ukazivao podatak o prozivljenim godinama koji je restituisao Vulic.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(149, 'IMS.1.83', 'Dei in domu Termogenes votum fecit.', 11, 4, 5, 9, 2, -1, 4, 10, 35, NULL, 3, NULL, NULL, NULL, NULL, 'svetiljka', 'bronza', '17:42:23', 'Bronzana svetiljka u obliku broda potice verovatno iz sredine III veka. Popovic. U Mezulu su 1966. godine iskopana dva cupa sa srebrnim rimskim novcem koji hronoloski dopiru do 250. godine. Kako se neki motivi na lucerni mogu prepoznati kao hriscanski na primer predstava proroka Jone jedna od pretpostavki je da je objekat bio pokopan u vreme progona Decija Trajana. Medjutim neizvesno je da li bi spomenik trebalo datirati na osnovu pronadjene ostave novca. Same likovne predstave ne daju indicije za blize datiranje.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 1, 1),
(150, 'IMS.1.85', 'Iuliae Flor(ae)', 17, 4, 5, 11, 3, -1, 4, 10, 36, NULL, NULL, NULL, NULL, NULL, NULL, 'kasika', 'srebro', ':3:16', '', 'zaKontrolu', 'sara', '2015-11-29', '2016-01-27', 0, 1),
