(152, 'IMS.1.87', 'Iovi op(timo) m(aximo) Ediuna | f[rat]er confratri[b(us)].', 11, 4, 5, 9, 5, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na osnovi statue', 'beli mermer', '4:18:18', 'Ime Ediuna nije posvedoceno na drugim natpisima. Moguce je da je keltsko ime Edia ilirizovano dodavanjem nastavka una. Imenica frater javljala se uz nerimska bozanstva na primer uz Jupitera Dolihena i Mitru. Confratres se javlja retko.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(153, 'IMS.1.88', 'D(is) M(anibus) | P. Ael(ius) Priscus | mil(es) leg(ionis) VII Cl(audiae) | stip(endiorum) XXV v(ixit) a(nnis) L | P. Ael(ius) Ursulus | fil(ius) et P. Ael(ius) Ca|pito lib(ertus) | heredes f(aciendum) c(uraverunt).', 13, 4, 5, 10, 6, -1, 4, 7, 34, NULL, NULL, NULL, NULL, NULL, NULL, 'pravougaona ploca', 'krecnjak', '6:46:38', 'Spomenik je oko 1887. godine prebacen u Beograd kao poklon grada Pozarevca trgovcu Zlatkovicu.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(154, 'IMS.1.89', 'Dianae | Antonia | Procla ex | viso () v(otum) s(olvit) | l(ibens) m(erito).', 11, 4, 5, 9, 7, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'zuto sivi krecnjak', '8:51:27', 'Dijanin kult je dosta rasprostranjen kod rudara.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(155, 'IMS.1.90', '[I]ovi s(acrum) | [Iup]piter | Creses () | Mucati | v(otum) s(olvit) l(ibens) m(erito).', 11, 5, 5, 9, 8, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'votivni stub', 'meki kamen', ':112:', 'Obim stuba iznosi 139 cm. Slozena imena sa Muca spadaju medju najrasprostranjenija tracka imena. Latinsko ime Crescens cesto je medju Tracanima.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(156, 'IMS.1.91', 'Iuppiter | Aug(uste) | Dines Cel|si v(otum) s(olvit) l(ibens).', 11, 5, 5, 9, 8, -1, 4, 10, 34, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '35:81:42', 'Dedikant nosi ime trackog porekla. Neizvesno je poreklo ocevog imena Celsus. Matesku i Papazoglu ga smatraju trackim dok Vulic ukazuje na cinjenicu da se ovo ime cesto nalazi i u ilirskim krajevima. Ono je posvedoceno i u Panoniji. Moci.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(157, 'IMS.1.92', 'I(ovi) O)ptimo) M(aximo) | P. Ael(ius) Sexti|lianus [ .', 11, 5, 5, 9, 7, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '::', 'Natpis je zabelezio Majnert u Srbskim novinama iz 10. januara 1850. godine. Tekst je transkribovao velikim slovima i pogresno restituisao.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
