(159, 'IMS.1.94', 'I(ovi) O(ptimo) M(aximo) | Iuppiter | M. Aur(elius) Cre[s]|centio pr(o) | se et suos () | et cives () | v(otum) s(olvit) l(ibens) m(erito).', 11, 5, 5, 9, 8, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '22:87:35', 'Dedikant bi mogao biti sin Crescensa koji je pominje u IMS I 90.', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
(160, 'IMS.1.95', 'I(ovi) O(ptimo) M(aximo) | Aur(elius) Va|lerius | dec(urio) col(legii) | fab(rum) ABH | renovait () | v(otum) p(osuit) l(ibens) m(erito).', 11, 5, 5, 9, 9, -1, 4, 6, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'sivi krecnjak', '28:91:42', '', 'zaKontrolu', 'sara', '2015-11-29', '2015-11-29', 0, 1),
