(162, 'IMS.1.97', 'I(ovi) O(ptimo) M(aximo) | Cn. Clodius Cn. | fil(ius) Classicianus trib(unus) coh(ortis) XIIX vol(untariorum) c(ivium) Romanorum | et translat(us) ab opti|mis maximisq(ue) imp(eratoribus) in | coh(ortem) I Ulp(iam) Pan(noniorum) (milliarium) | eq(uitatem) | v(otum) s(olvit) l(ibens) m(erito).', 11, 5, 5, 11, -1, -1, 4, 10, 37, 161, 2, 'druga polovina', 169, 2, 'druga polovina', '', 'mermer', '30.5:89.5:46', '', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 1, 1),
(163, 'IMS.1.98', 'I(ovi) O(ptimo) M(aximo) | C. Gellius | Exoratus | praef(ectus) coh(ortis) | V Lucens(ium) | v(otum) s(olvit) l(ibens) l(aetus) m(erito).', 11, 5, 5, -1, 9, -1, 4, 6, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'sivi krecnjak', '32:91:44', 'Spomenik se od maja 1898 nalazi u beogradskom Narodnom muzeju. Kohorta koja se pominje u natpisu V Callaecorum Lucenaium imala je stalni logor u Gornjoj Panoniji. Najverovatnije je  privremeno bila stacionirana na Kosmaju u periodu imedju 166 i 169. godine mada to nije potvrdjeno.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(164, 'IMS.1.99', '[I(ovi) O(ptimo) M(aximo) | [ . S]cribonius | Faustus v(eteranus) e I Aure(lia) n(ova) | Pa[s]ina[tum] c(ivium) R(omanorum) (milliaria)', 11, 5, 5, -1, 7, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'beli krecnjak', '18:25:14', 'Majnert je u Srbskim novinama iz 10. januara 1850. godine pogresno transkribovao tekst natpisa SC ivu FAUSTUS LAVINAS. Ukoliko bi razresenje trebalo usaglasiti sa Majnertovom ispravkom licnost na natpisu bi se zvala Aurelius Lavinas. Prema Premerstajnu i Vulicu radi se o zenskoj osobi koja se verovatno zvala Aurelia Pasina. Kognomen je liburnijski. Ne mozemo odbaciti ni druge mogucnosti na primer Pauilina ili neko trece ime.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(165, 'IMS.1.102', 'I(ovi) O(ptimo) M(aximo) P(aterno) | Sent()|[i]a Flav|[en]til[la] | v(otum) m(erito) l(ibens) s(olvit).', 11, 5, 5, -1, 10, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '::', '', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(166, 'IMS.1.100', 'I(ovi) O(ptimo) M(aximo) | Vitalis | pro se et su|is v(otum) s(olvit) l(ibens) m(erito).', 11, 5, 5, -1, 11, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '50:42:40', 'Spomenik se nalazio u Bacevcu sigurno do pocetka XX veka kada su Premerstajn i Vulic objavili tekst natpisa 1903. godine.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(167, 'IMS.1.101', 'I(ovi( O(ptimo) M(aximo) | [p]ro salute | [Caes]ar(is) n(ostri) | [ .', 11, 5, 5, -1, 7, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', ':36:29', 'Sve do otprilike 1909. godine spomenik se nalazio u dvoristu skole u Stojniku.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(168, 'IMS.1.103', 'Iovi et Herculi | templum fecit | Vecilia Tyranni Aug(usti) | lib(erti) proc(uratoris). Locus datus | ab Appaeo Hermete et Fabis | tribus.', 11, 5, 5, -1, 10, -1, 4, 10, 13, NULL, 1, NULL, NULL, NULL, NULL, 'votivna tabla', 'zuckasti krecnjak', '22:100:37', 'Herkul se smatrao zastitnikom rudara. Odredjene karakteristike pisma upucuju na drugu polovinu I ili pocetak II veka.  Vecilija je verovatno bila zena i robinja Tiranisa. Njeno ime potice od gentilnog imena i moguce je da postoji izvesna veza izmedju dedikanta ovog natpisa i L. Vecilija Modesta s obzirom na retkost gentilicija Vecilius. Lucije  je bio prefekt kohorte I Thracum Syriaca koja je bila stacionirana u Ravni od otprilike 70. godine. Vecilijin muz je bez sumnje sluzio na Kosmaju kao  prokurator nad rudnicima. Ukoliko je Vecilija bila Modestova oslobodjenica spomenik bi trebalo datovati najdalje u kraj I veka.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 1, 1),
(169, 'IMS.1.104', 'D)(eo) M(ithrae) [S(oli) ] | pro s(alute) im(peratoris) S(everi) Ale|xandri Au|g(usti) G(aius) C() Marcellus | et Marius Vict[o]|rinus posu[e]|runt l(ibentes) m(erito).', 11, 4, 5, -1, 7, -1, 4, 10, 19, NULL, 3, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', ':53:33', 'Pocetkom XX veka kada je Vulic objavio clanak o ovom natpisu spomenik se nalazio u kuci Ilije Jerinica u Stojniku.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 1, 1),
(170, 'IMS.1.105', 'Invicto deo | Ision Caes(aris) n(ostri) ser(vus) | vil(icus) vectigal(is) Il|lyr(ici) templ(um) omn(i)|re instruct(um) a | solo p(ecunia) s(ua) f(aciendum) c(uravit).', 11, 5, 5, -1, 10, -1, 4, 10, 13, NULL, 2, NULL, NULL, NULL, NULL, 'zrtvenik', '', '11:37:36', 'Spomenik je otkriven 1877. godine u Guberevcu a oko 1900. godine nalazio se u Beogradu u Odseku za rudnike.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 1, 1),
(171, 'IMS.1.106', 'Deo Pa|tron(o) | Val[2 3] | [1 2] S [1 2] LI | [ ] | v(otum) p(osuit) [l(ibens) m(erito)].', 11, 5, 5, -1, 8, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '::', 'Deus Patronus bi mogao biti Herkul.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(172, 'IMS.1.108', 'Silvano Au(gusto) | Conservato(ri) | M. Ulp(ius) Teren|tius cum sui(s) | v(otum) s(olvit) l(ibens) m(erito).', 11, 5, 5, -1, 10, -1, 4, 10, 38, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'zuckasti pescar', '12:39:26', 'Spomenik je pronadjen pre septembra 1951. godine kada ga je Maric video. Silvan sa retkim epitetom Conservator smatran je verovatno zastitnikom rudara.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(173, 'IMS.1.109', 'Tekst natpisa nije poznat', 11, 5, 5, -1, 7, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '::', 'Spomenik je otkriven 1912. godine. Spomenik je prema Vulicevim recima bio posvecen Silvanu od strane jednog beneficijara.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(174, 'IMS.1.110', '] | [ ] Nig[rini] | [V]ibiani | [C]aesen[ni]|us Nigri[nus] | [tri]b(unus) coh(ortis) | [       Vulic.', 11, 5, 5, -1, 7, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'pescar', '14:62:39', 'Spomenik je otkriven oko 1909. godine ispred skole u Stojniku. Caesennius bi mogla biti transkripcija za gentilno ime Caesernius koje je rasprostranjeno u Panoniji preko Akvileje.', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(175, 'IMS.1.111', 'C. Ce[t]ron[ius. . . ]|anus  com. . . | [v(otum)] s(olvit) l(ibens) m(erito)   Vulic.', 11, 5, 5, -1, 8, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'meki kamen', '12:38:38', '', 'zaKontrolu', 'sara', '2015-11-30', '2015-11-30', 0, 1),
(176, 'IMS.1.112', '] | Marc[i]an[u]s [ ] | [c]oh(ortis) II Aur(eliae) n(ovae) (miliariae) e(quitatae) | [Anto]ninianae () | v(otum) d(edit) et vo[tu]|m so(l)vit     Vulic.', 11, 5, 5, -1, 7, -1, 4, 10, 19, 211, 3, 'prva polovina', 217, 3, 'prva polovina', 'zrtvenik', 'meki krecnjak', '20:58:48', 'Spomenik se mogao videti sigurno 1909. godine kada je Vulic zabelezio da se zrtvenik nalazi u Stojniku u dvoristu Milojka Ivanovica.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 1, 1),
(177, 'IMS.1.115', 'D(is) M(anibus) | Iul(ius) Ascius vix(it) | ann(is) C et Iul(ia) Pro|culina vix(it) ann(is) XL | Licinia Bonosa | coniugi et fil[i]e | cariss(imis) et Iul(io) Iuli|ano gener(o) vetra(no) | alae Itureor(um) qui vix(it) | ann(is) LX et sibi viva p(osuit).', 13, 5, 5, -1, 12, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'meki krecnjak', ':198:92', 'Spomenik je otkriven 1901. godine u Lisovicu u dvoristu Petra Paunovica gde se mogao videti i 1903. godine. Vojna jedinica koja se javlja na natpisu moze se identifikovati sa ala I Augusta Ituraeorum sagittariorum stacionirana u jugoistocnoj Donjoj Panoniji. Iulian je najverovatnije dosao na Kosmaj nakon otpusta iz sluzbe.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(178, 'IMS.1.116', 'Valetu|dinarius | coh(ortis) II Aur(eliae) | nov(ae) (milliariae) equit(atae) | c(ivius) R(omanorum) T. Bebeni|us Iustus prae(fectus) | Imp(eratore) C[[ommodo]] II et Vero II co(n)s(ulibus).', 13, 5, 5, -1, 7, -1, 4, 10, 13, 179, 2, 'druga polovina', NULL, NULL, NULL, 'cipus', 'sivi krecnjak', '19:80:36', 'Spomenik je otkriven u Stojniku i prebacen u beogradski Narodni muzej pre 1900. godine.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 1, 1),
(179, 'IMA.1.117', 'D(is) M(anibus) | Septimiu[s 2] | LUCANUS t[2 3] | coh(ortis) II Aur[ ] | [', 13, 5, 5, -1, 10, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'beli krecnjak', '27:31:51', 'Stela je otkrivena u Gumnistu kod Guberevca. Oko 1900. godine mogla se videti kod zvonika ispred skole u Stojniku.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(180, 'IMS.1.118', 'D(is) M(anibus) | Claudia Casta | vixit ann(is) XXXII | et Aurelia Flora | vixit ann(is) L | Aurel(ius) Acutio | mil(es) coh(ortis) II Aure|liae n(ovae) coniugi | et matri veneme|rentis et sibi vi|vus fecit.', 13, 5, 5, -1, 10, -1, 4, 10, 38, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'zuckasti pescar', '20:186:85', 'Spomenik je otkriven oko 1951. godine u Guberevcu. Kako je pomenuta kohorta foprmirana tek oko 169. godine stela nije starija od druge polovine II veka.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(181, 'IMS.1.119', 'D(is) M(anibus) | Aur(elia) Procla | vixit ann(is) | XXXII tit(ulum) p(osuit) | Aurel(ius) Victor | mil(es) c(ohortis) II Aur(eliae) n(ovae) SA | COR c(oniugi) b(ene) m(erenti).', 13, 5, 5, -1, 13, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'sivi pescar', '29:194:75', 'Spomenik je iz Sopota prebacen mozda u Ropocevo a zatim u Narodni muzej u Beogradu oko 1897. ili 1988. godine. Stela nije starija od 169. godine kada je otpriklike formirana kohorta II Aurelia nova.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(182, 'IMS.1.120', 'D(is) M(anibus) | Publius Aelius | Victorinus vet(eranus) | coh(ortis) II Aurel(iae) nove () | vixit ann(is) LX Aurel(ia) Ru|fina coiugi () b(ene) m(erenti) et | P. Ael(ius) Acutianus | et P. Ael(ius) Victorinus | patri et sibi vivi posu|erunt.', 13, 5, 5, -1, 7, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'sivkasti krecnjak', '33:203:83', 'Spomenik je otkriven pre 1931. godine i bio je u vlasnistvu Ljubislava Mihailovica. S obzirom da je pokojnik bio veteran kohorte II Aurelia nova i ziveo sezdeset godina stela ne moze biti starija od pocetka III veka.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(183, 'IMS.1.121', 'D(is) M(anibus) | Aeliae Luciae vix|it annis XLV Aurel(ius) | Bardibalus dec(urio) | coll(egii) cent(onariorum) coniugi | et Aurel(ius) Lucilius ma|tri b(ene) m(erenti) et sibi vi|vi posuerunt.', 13, 5, 5, -1, 7, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'sivkasti krecnjak', '30:142:94', '', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1);
INSERT INTO `objekat` (`id`, `oznaka`, `tekstNatpisa`, `vrstaNatpisa`, `jezik`, `provincija`, `grad`, `mesto`, `pleme`, `modernaDrzava`, `modernoMesto`, `ustanova`, `pocetakGodina`, `pocetakVek`, `pocetakOdrednica`, `krajGodina`, `krajVek`, `krajOdrednica`, `tip`, `materijal`, `dimenzije`, `komentar`, `faza`, `korisnickoIme`, `datumKreiranja`, `datumPoslednjeIzmene`, `datovano`, `lokalizovano`) VALUES
(184, 'IMS.1.122', 'D(is) M(anibus) | Attius Victo|ris vix anni|s LXX Aia Atti filia | vixit an(nis) XXX Pro|pingus () Atti filius | vixit an(nis) XXV Gresa | Dasantis vixit an(nis) | LXXX titulum posuit | Zaca Vaenti coniugi | filis et matri et sibi vive () b(ene) m(erentibus).', 13, 5, 5, -1, 13, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'sivi krecnjak', ':229:77', 'Gresa Dasantis nosi ilirsko ime i dobro poznat patronimik. Verovatno je slican slucaj i sa cerkom mada ime Vaentius nije posvedoceno na drugim mestima. Zaca je najverovatnije ilirsko ime mada ima analogija i u keltskoj i trackoj onomastici. Attius i Aia su verovatno keltska imena mada Aia moze biti i ilirsko. U okolini Pozege posvedoceno je ime Aurelia Aioia CIL III 14607  a u Saloni Aurelia T. f. Aia RIB I n. 1828. Moguce je da porodica koja se javlja na natpisu  potice iz Dalmacije.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(185, 'IMS.1.123', 'Aurel(ius) De|mas vix(it) ann(is) | LXXX Aurel(ius) | Lucidus et | Aurelia Aquil|lina et Aurel(ius) | Vitalis nepotes et here|des avio be|nemerenti | posuerunt.', 13, 5, 5, -1, 9, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'sivi pescar', '37:155:68', 'Demas je grcko ime. Jedan Aurelius Vitalis pominje se i na natpisu IMS I 125.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(186, 'IMS.1.124', '] | M. Au[r(elius) P]robus | [v]ix(it) an(nis) LXXX M. | Aur(elius) Prisgianus () | vix(it) an(nis) XX Aur(elia) | Maxima con(iugi) | k(arissimo) et fil(io) pien(tissimo) et | sisi () viva pos(uit) M. Aur(elius) Caperic(us) | et Aur(elia) Maximi|na p(atri) et fr(atri) b(ene) m(erentibus) | p(osuerunt).', 13, 5, 5, -1, 13, -1, 4, 10, 39, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'beli krecnjak', '26:96:70', 'Stela je 1897. godine prebacena u beogradski Narodni muzej.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(187, 'IMS.1.125', 'D(is) M(anibus) | Aur(elii) Vitalis vixit an|n(is) XXVII et Firmus vixit | ann(is) XXV et | M. Aur(elius) Res|pectus et Aur(elia) Vene|ria filis b(ene) m(erentibus) p(osuerunt) et sibi | vivis posuerunt cum | M. Aur(eliis) Respectiano | et Hilerione () fil(is) p(ientissimis).', 13, 4, 5, -1, 7, -1, 4, 10, 16, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'sivkasti krecnjak', '34:179:78', 'Spomenik je otkrio Aleksandar Pavlovic kod Stojnika 1961. godine.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(188, 'IMS.1.125bis', 'D(is) M(anibus) | Chrysophoro et | Primitivae Adi|iutoris () [s]er(vis) [3]|tus fratris () b(ene) m(erentibus) p(osuit).', 13, 5, 5, -1, 10, -1, 4, 10, 19, NULL, 1, NULL, NULL, NULL, NULL, 'nadgrobna ploca', '', '::', 'Nisu poznate tacne dimenzije spomenika ali se na osnovu dve fotografije pretpostavlja da je otprilike 70 50 cm. Bez ukrasa je. Imena pokojnika Hrisofor Primitiva i Adiutor otkrivaju helenofono poreklo i karakteristicna su za nize slojeve drustva gde spadaju i rudari. Imenica fratres upucuje na zakljucak da su Hrisofor Primitiva i treca osoba cije ime nedostaje bili clanovi jednog kolegijuma. Na osnovu oblika slova i izgleda ploce pretpostavlja se da je spomenik iz druge polovine I veka.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 1, 1),
(189, 'IMS.1.126', 'P. Covirio | Gentili | Trevero | P. Covirius | Optatus | frater fecit.', 13, 5, 5, -1, 14, -1, 4, 10, 40, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'sivkasti krecnjak', '15:150:70', 'Stela je u XV veku bila ugradjena u zidove manastira Pavlovac u Koracici a od 1915. godine je uzidana u fontanu Grab. Kasnije je prebacena kod kioska Politika takodje u Koracici. Gentilicij Covirius ili Covirus specifican je za Trevere. Pojedini treverski Covirii bili su clanovi jednog kolegijuma collegium dolabriorum CIL XIII 11313.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(190, 'IMS.1.127', 'Demoste[nes] () | [F]ilippu () vi[x(it) an(nis)] LXXXV Ge[3]|a Quarti c[oni]|iugi pientis[simo] | [e]t Marcel[lus () fi]|[l]ius () patri | [p]osuer[unt].', 13, 5, 5, -1, 15, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'krecnjak', ':159:46', 'Ime i patronimik su grckog porekla i najverovatnije je pokojnik a mozda i kamenorezac iz neke helenofone zemlje.', 'zaKontrolu', 'sara', '2015-12-01', '2015-12-01', 0, 1),
(191, 'IMS.1.128', 'D(is) [M(anibus)] | Emb[a]sia Antoni | filia vicsit  () anis () | XX. Posuit Anto|nius Germani f[i]|lie () bene mer[en]t[i].', 13, 5, 5, -1, 16, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', '', '30:155:70', 'Spomenik je pronadjen u septembru 1901. godine u Medovistu izmedju Velike Mostanice i Meljaka.', 'zaKontrolu', 'sara', '2015-12-02', '2015-12-02', 0, 1),
(192, 'IMS.1.129', 'D(is) M(anibus) | C. Iul(io) Q. f(ilio) Serg(ia) | [R]ufo Libur(no) | Fl(avia) [Ma]rulla con(iug[ipi]entiss(imo) | vix(it) an(nis) [L]XI. H(ic) s(itus) e(st).', 13, 5, 5, -1, 10, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'beli mermer', '12:150:66', 'Gaj Juliji i Rufi su dosta cesti na prostoru Liburnije gde se nalazi dosta gradova koji pripadaju tribi Sergia. Aenona Arba Corinium Iader Ortoplinia Senia Tarsatica Vegia. Naziv Liburnus moze predstavljati cisto etnicko obelezje a moze se tumaciti i kao aluzija na administrativnu nezavisnost Liburnije u I i II veku. Ime Marulla se srece na teritoriji Dalmacije.', 'zaKontrolu', 'sara', '2015-12-02', '2015-12-02', 0, 1),
(193, 'IMS.1.130', 'Iulius [ ] |nio posuit s[ibi] et coiugi () Pusia|e pientissime () et filie () Primitive () | k(arissimae) et Diopaneti | Dionisi () genero pio vixit | () anno(s) XX.', 13, 5, 5, -1, 12, -1, 4, 10, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'krecnjak', '35:110:68', 'Spomenik je otkriven u kuci Petra Paunovica u Lisovicu gde se prema Vulicevom svedocenju nalazio i 1912. godine. Pusia bi moglo biti keltsko ime mada ne treba odbaciti mogucnost da je nastalo od latinskog pusa devojka. Cini se da patronimik nagovestava da je Diopanes tracko ime mada bi u odredjenom slucaju moglo biti i ilirsko.', 'zaKontrolu', 'sara', '2015-12-02', '2015-12-02', 0, 1),
(194, 'IMS.1.131', 'D(is) M(anibus) | Marcus Telest(ae) | vixit an(nis) XXXX | Tittha mater he(res) | bene me(renti) | fe(cit).', 13, 5, 5, -1, 13, -1, 4, 10, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'stela', 'sivi krecnjak', '26:176:67', 'Oko 1900. godine spomenik se nalazio u beogradskom Narodnom muzeju. Tittha se cesto smatra ilirskim ili trackim imenom sto je pogresno. Ime je zapravi grcko', 'zaKontrolu', 'sara', '2015-12-02', '2015-12-02', 0, 1),
