(222, 'IMS.2.16', 'Dio ()  | Eroni () | Aur(elius) Gai|us vet(er)a|nus l(e)g(ionis) | IIII Fl(aviae)  An(toninianae) | vot(um) s(ol)v(i)t.', 11, 5, 5, 10, -1, -1, 4, 7, 38, NULL, 3, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '15:35:16', 'Zamena samoglasnika e slovom i u reci Deo posvedocena je vise puta. Izostavljanje glasa H u reci Eroni takodje je vec posvedoceno u Viminacijumu. Dodatak nazivu legije Antoniniana potvrdjen je i na natpisu iz Singidunuma IMS I 40. Naziv legije upucuje na datovanje spomenika u epohu Septimija Severa ili Karakale.', 'zaKontrolu', 'sara', '2015-12-09', '2015-12-09', 1, 1),
