(225, 'IMS.2.19', 'I(ovi) O(ptimo) M(aximo) | Prus[ius] | Apol[lo]|nius [v(otum) s(olvit) ]  | l(ibens) m(erito).', 11, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'pescar', '48.5:80:34', 'Prusius je redak gentilicij i njegova etimologija je neizvesna. Posvedocen je na jos jednom spoemniku u Gornjoj Meziji u gradu Akve Prusius Maximus i na jednom spomeniku iz Dalmacije  Prusius Optatus. Apollonius je cesce posvedoceno nego Apollinius i posvedoceno je u Skupima i u Viminacijumu .', 'zaKontrolu', 'sara', '2015-12-09', '2015-12-09', 0, 1),
