(228, 'IMS.2.22', 'I(ovi) O(ptimo) M(aximo) Cons(ervatori) Imp(eratoris) | Caes(aris) L. Sept(imii) Sever[i] | Pert(inacis) Aug(usti) | M. Petr(onius) Pierio dec(urio) Q[.] | m(unicipii) A(elii) V(iminacii) ob hon(orem) fl(amonii) M. Petr(onii) | Rustici fili sui qui et | C. Valeri ex libr(is) X er | s(estertium) (centum milibus) n(ummum) rei p(ublicae) d(ono) d(edit).', 11, 5, 5, 10, -1, -1, 4, 7, 50, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik ili baza statue', 'beli mermer', '18:45:24', 'Gentilicij Petronius rasprostranjen je u Gornjoj Meziji. Posvedocen je kod vojnika koji su se putem dedukcije naselili u Skupima kao i u Singidunumu gde jedna zena vojnika legije IV Flavia poreklom iz Skupa nosi ime Petronia Secunda IMS I 37. Kognomen Pierio grckog je porekla. Marko Petronije je mozda dosao iz neke helenofone oblasti. Onomasticka formula Petronius Rusticus qui et C. Valerius izgleda kao supernomen punog rimskog imena. Moguce je da je rec o adopciji u gens Petronia.', 'zaKontrolu', 'sara', '2015-12-09', '2015-12-09', 0, 1),
(229, 'IMS.2.23', 'I(ovi) O(ptimo) M(aximo) | Cons(ervatori) | Cassius | Gemelus () | aq(uilifer) v(otum) p(osuit).', 11, 5, 5, 10, -1, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik cilindricnog oblika', '', ':60:26', 'Conservator se cesto javlja kao Jupiterov epitet.', 'zaKontrolu', 'sara', '2015-12-09', '2015-12-09', 0, 1),
