(241, 'IMS.2.35', 'Deae Ne[mesi     cum] suis [    ]', 11, 5, 5, 10, 18, -1, 4, 7, 52, NULL, NULL, NULL, NULL, NULL, NULL, '', '', ':10:7', '', 'zaKontrolu', 'sara', '2015-12-16', '2015-12-16', 0, 1),
(242, 'IMS.2.36', 'D(eae) R(eginae) N(emesi) | Ael(ius) Pompeianus | quod adiutor pomi|si () fr(umentarius) posui.', 11, 4, 5, -1, 18, -1, 4, 7, 38, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat statuete', 'beli mermer', '9:14:16', 'Natpis se nalazi na polukruznoj osnovi na kojoj se nalazila statua. Od statue su sacuvana samo stopala. Elije Pompejan je bio frumentarius verovatno legije VII Claudia nakon cega je unapredjen  u adiutora. Cognomen Pompeianus najverovatnije upucuje na zakljucak da je dedikant bio poreklom sa istoka. Nemesis se kao Dea javlja na jos dva natpisa iz Viminacijuma IMS II 35 i 37. Regina je njen cest epitet. Na statueti je pretstavljena i zivotinja najverovatnije grifon kao na IMS II 37.', 'zaKontrolu', 'sara', '2015-12-16', '2015-12-16', 0, 1),
(243, 'IMS.2.38', '[Ne]ptu[no | C]onservat[or(i) | A]ug(ustorum) et Cae[s(arum duorum)] | [le]g(io) VII Cl(audia) d(evota) n(umini) | ma(iestati)q(ue) eoru[m].', 11, 5, 5, 10, -1, -1, 4, 7, 19, NULL, 3, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '27:40:32', 'Neptunov hram se pominje na natpisu IMS II 61. Neptunus Conservator je jedinstven primer i ne moze se naci ni na jednom drugom natpisu. Domasvski je izneo pretpostavku da se natpis nalazio kod mosta na Dunavu. Neptun nije samo bozanstvo mora vec i rekao. Formula Augusti et Caesares se mozda odnosi na Dioklecijana i njegove savladare. U tom slucaju natpis bi se mogao datovati u kraj III ili pocetak IV veka.', 'zaKontrolu', 'sara', '2015-12-16', '2015-12-16', 1, 1),
(244, 'IMS.2.40', 'a)   Scholae | Genio men|sorum et leg(  ) VII | Cl(audiae) pro salute | d(ominorum) n(ostrorum) Aug(ustorum duorum) | Alexander For|tunati disp(ensator) horr(eorum) | d(onum) d(edit).        b) [ante diem] III [k]al(endas) d[ec(embres   ] | Gallo et Volus[iano] Aug(ustis) co(n)s(ulibus).', 12, 5, 5, -1, 6, -1, 4, 7, 11, 252, 3, 'druga polovina', NULL, NULL, NULL, 'stub', 'ruzicasti mermer', ':77:', 'Stub je prepolovljen na dva dela. Oba dela su pronadjena 1971. godine u Drmnu. Skracenica leg bi se mogla dopuniti kao legionis i kao legioni te bi pun tekst izgledao ovako Genio mensorum et Genio legionis ili Genio mensorum et legioni. Konzulat Gala i Volusijana pada u 252. godinu. Ukoliko je drugi deo stuba zaista deo stuba a onda bi datum 29. novembar mogao biti dies imperii Gala i Volusijana.', 'zaKontrolu', 'sara', '2015-12-16', '2015-12-16', 1, 1),
(245, 'IMS.2.41', 'Deabus silv|estris () Achil|leus ex v|oto l(ibens) pos(uit).', 11, 5, 5, -1, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'pescar', '30:39:30', 'Vulic je deae silvestres identifikovao kao Silvanae Silvestres. Moguce je da se radi o sumskim nimfama grckim drijadama. Nimphae silvestres javljaju se na natpisu iz Klisa u Dalmaciji. Grcki uticaj se lako moze objasniti ako se ima u vidu da je dedikant poreklom iz grckih ili helenizovanih zemalja. Dedikant je najverovatnije bio rob jer ima samo jedno ime.', 'zaKontrolu', 'sara', '2015-12-16', '2015-12-16', 0, 1),
(246, 'IMS.2.42', 'V. Ladek Premerstein Vulic.', 11, 5, 5, -1, -1, -1, 4, 7, 11, NULL, 3, NULL, NULL, NULL, NULL, 'ploca', 'beli mermer', '13:69:62', 'Ploca je otkrivena u Kostolcu 1901. godine.', 'zaKontrolu', 'sara', '2015-12-16', '2015-12-16', 1, 1),
(247, 'IMS.2.43', '] pro sa[l(ute) ] Imp(eratoris) | T. Aeli Antoni[ni Aug(usti) ] | et Aureli Ve[ri Caes(aris) ] | Spendon Aug[g(ustorum) n(ostrorum) (duorum) ] | disp(ensator) | [a] solo resti[t(uit)].', 11, 5, 5, -1, -1, -1, 4, 7, 11, NULL, 2, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '39:46:45', 'Antoninu Piju i Aureliju Veru posvecen je i natpis IMS II 51 i datuje se 158. ili 159. godinom. Kao T. Elije Antonin car se javlja i na natpisima  CIL III 7488 i 7466 u Donjoj Meziji. Formula solo restituit verovatno se odnosi na hram koji se mozda pominjao na delu natpisa koji nije sacuvan. Natpis se datuje u period izmedju 138 i 161. godine.', 'zaKontrolu', 'sara', '2015-12-16', '2015-12-16', 1, 1),
(248, 'IMS.2.44', 'a)  ] | [pr]o salute | [. .|  Calp(urnii) H[.]NO | [.] ATIANI praef(ecti) | leg(ionis) VII Cl(audiae) | C. Iul(ius) Ingenus () lib(erarius) l(egionis) | FACTALEG v(otum) s(olvit) l(ibens) m(erito) | et EXACTI COS BF et frum( )    b) [ ]4 NOII | Rufo co(n)s(ulibus).', 11, 4, 5, -1, -1, -1, 4, 7, 11, NULL, 2, NULL, NULL, NULL, NULL, 'zrtvenik', 'porozni krecnjak', '35:60:56', 'Datovanje natpisa donekle je moguce na osnovu imena konzula Rufa. Neizvesno je o kom je Rufu rec. Konzuli sa tim imenom potvrdjeni su 145. 155.182. 186. 193. mozda 199 203. 218 222. godine. Prethodna dva slova NO mogla su biti deo imena drugog konzula. Godine 182. konzulski par cinili su Mamertino i Ruf zato bi se moglo pretpostaviti da je natpis nastao ove godine. Na vreme pre 1936. godine upucuje i titula praefectus legionis.', 'zaKontrolu', 'sara', '2015-12-17', '2015-12-18', 1, 1),
(249, 'IMS.2.45', '] | Ael(ius) Vita[lis] | vet(eranus) ex me[ns(ore) tr]|itici leg(ionis) V[II Cl(audiae) pr]|o salute sua [4] | [vo]t(um) p[os]ui[t.', 11, 5, 5, -1, -1, -1, 4, 6, 35, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'pescar', '31:56:44', 'Mensor tritici javlja se i na natpisu IMS II 126.', 'zaKontrolu', 'sara', '2015-12-18', '2015-12-18', 0, 1),
(250, 'IMS.2.46', '6 7 S]acerdotes eiusd[em] | dei.', 11, 5, 5, -1, 6, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '60:72:55', 'Pre nego sto je nestao spomenik se neko vreme nalazio u dvoristu gimnazije u Pozarevcu. Rec je o donjem delu zrtvenika sa dosta ostecenim natpisnim poljem. Premerstajn i Vulic pretpostavljali su da su dedikanti robovi jednog kolegijuma i da je ime dominusa istaknuto na kraju drugog reda Bulli Hiverni. Medjutim nista ne ukazuje na to da je poreklo dedikanata bilo robovsko. Pre ce biti da je rec o autohtonom stanovnistvu cija imena su napisana zajedno sa patronimikom      Castoris   ianus Bassi    us Marri   Sabinus Gai. Ime Bassus moglo bi bitoi tracko ime.', 'zaKontrolu', 'sara', '2015-12-21', '2015-12-21', 0, 1),
(251, 'IMS.2.47', '] | M. Terti[us] | Chrestu[s] | frum(entarius) et | Tert(ia) Val(  ) | Romana fili|a eius.', 11, 5, 5, -1, -1, -1, 4, 7, 53, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '27:60:27', 'Zrtvenik je otkriven na mestu zvanom Kod Grobalja od strane M. Koraca i D. Jacanovica.  Pomen frumentarijusa bez navodjenja imena jedinice javlja se i na natpisu IMS II 36. Gentilicij Tertius retko se srece u Italiji dok u Dalmaciji nije posvedocen uopste. Najzastupljeniji je u Narbonskoj Galiji. Ime Chrestus nije retko medju robovima i oslobodjenicima. Isti slucaj je i sa kognomenom Romanus i Romana.', 'zaKontrolu', 'sara', '2015-12-21', '2015-12-21', 0, 1),
(252, 'IMS.2.48', '] | ex voto p[osu]|it.', 11, 5, 5, -1, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'beli mermer', '10:44:33', '', 'zaKontrolu', 'sara', '2015-12-21', '2015-12-21', 0, 1),
(253, 'IMS.2.49', '] CC AA | [   Alexa]nder et M | [   ] Q colleg(ii)  I[. . .].', 11, 5, 5, -1, 23, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'skulptura', '', '8:17.5:13', 'Spomenik je otkriven 1960. godine u Klicevcu. Sacuvan je samo fragmenat skulpture i to deo postolja pramca i veslaca koji kleci.Treci red u natpisu mogao bi se tumaciti kao quinquennalis collegii M. Mirkovic. Moguce je da je statua pretstavljala boginju Anonu koja je ponekad prikazivana sa pramcem broda a kolegijum koji se javlja na natpisu mogao bi se odnositi na mornare collegium nautarum.', 'zaKontrolu', 'sara', '2015-12-21', '2015-12-21', 0, 1),
(254, 'IMS.2.50', '[Imp(erator) Caes(ar) | Divi Tr[aiani Parthici f.] di[vi Nervae] | [n]epos Tr[aianus Hadrianus Aug. pont. max.] | [trib. pot. 4 c]o(n)s(ul) III p(ater) [ p(atriae) ] | [per   leg. Aug. pr. pr. viam] novam qua[e coe]|[pta a divo patre suo Traia]no compen[dio ] | [facto per m.p.  ] a Ma[rgo flumine] in Dardania[m] | [direxit et munivit ita ut vehicula] commeare | [possint  ] fe[cit.', 14, 5, 5, -1, -1, -1, 4, 7, 11, 119, 2, 'prva polovina', NULL, NULL, NULL, 'ploca', 'beli mermer', '::', 'Datovanje natpisa moguce je na osnovu pomena treceg Hadrijanovog konzulata.', 'zaKontrolu', 'sara', '2015-12-21', '2015-12-21', 1, 1),
(255, 'IMS.2.51', 'I Face anterieure         [Pro sal]ute | [Imp(eratoris) Cae]s(aris) T. Ael(ii) | [Anton(ini) A]ug(usti) Pii | [et Veri] Caes(aris) | [vet(erani) le]g(ionis) VII | [Cl(audiae) p(iae) f(idelis) pr]obati | [Servia]no et | [Varo et Po]ontian(o) | [et Attico]o co(n)s(ulibus) | [m(issi) h(onesta) m(issione) pe]r Cur|[tium Ius]tum | [leg(atum) Aug(usti)] pr(o) pr(aetore) | [4 le]g(  ) leg(ionis) | [et sun]t n(umero) CCXXXIX | [Ul]p(ius) Pharnax [V]al(erius) Maxi(mus) | [S]extius Maxi(mus) | [coh(ors)] I [  ] II Face laterale droite  Val(erius) Aquil(inus) b(ene)f(iciarius) | Siliu(s) Felix | Aemil(ius) Myr(isimus) | Passid(  ) MRI (   ) | Val(erius) Maxi(mus) | Ael(ius) Fort(unatus) s [  ] | Val(erius) Vale(ns) | Pupin(ius) Lati(nus) | Longi(nus) Alex(ander) | Ael(ius) Longu[s] | Ael(ius) August(inus) c[or(nicularius) ] | Ael(ius) Aquili(nus)  | Iul(ius) Longin(us) | Ael(ius) Maxi[m(us)] | Ael(ius) Festu[s] | coh(ors) III | Ael(ius) Rufu[s] | Iul(ius) Niarc[h(us)] | L. Val(erius) Procu[l(us)]', 14, 4, 5, -1, -1, -1, 4, 7, 13, 158, NULL, NULL, 159, 2, 'druga polovina', 'osnova', 'beli mermer', '22:70:25', '', 'zaKontrolu', 'sara', '2015-12-21', '2015-12-21', 1, 1),
(256, 'IMS.2.52', '[Pro sal]ute Imperato[ris Caesaris M. Aurelii] | [Ant]onini Aug(usti) et I[mp(eratoris) Caes(aris) L. Aurelii Veri Aug(usti) ] | [M. Stati]us Priscu[s Licinius Italicus] | [leg(atus) Augustor(um) pr(o) p]r(aetore) provin[c(iae) Moesia]e Sup[erioris] | [item leg(atus) August]or(um) [provin]c(iae) Britan[niae] | [  ] f(ecit).', 14, 4, 5, -1, -1, -1, 4, 7, 19, 161, 2, 'druga polovina', NULL, NULL, NULL, 'zrtvenik', 'pescar', '23:25:40', 'Statije Prisk Licinije Italik bio je vojni komandant u Dakiji 157. i 158. godine konzul 159. zatim curator alvei Tiberis upravnik provincije Gornje Mezije posle 161. godine ali pre smrti cara Antonina Pija upravnik Britanije 161. i 162. godine a nakon toga i Kapadokije.  Spomenik je podignut 161. godine prilikom postavljanja Licinija Italika na novu funkciju u Britaniji najverovatnije nakon pobedonosne kampanje na granici sa Dakijom.', 'zaKontrolu', 'sara', '2015-12-21', '2015-12-22', 1, 1),
(257, 'IMS.2.53', 'Face anterieure [Imp(eratori) Caes(ari)] |  [L. Septimio Severo Pertin]a[ci] | [Aug(usto) Arab(ico) Adiab(enico) et M.] Aurel(io) | [Anton(ino) Caes(ari) vet(erani) l]eg(ionis) VII Cl(audiae) | [p(iae) f(idelis) prob(ati) Prisco et Ap]ollinar(e) co(n)s(ulibus) | [m(issi) h(onesta) m(issione) per C. Gabi]n(ium) Pompeianum | [leg(atum) Aug(usti) pr(o) pr(aetore)] et Lael(ium) Maximum | [leg(atum) leg(ionis) VII Cl(audiae) p(iae) f(idelis) Cle]ment(e) et Prisco co(n)s(ulibus) | [coh(ors) I...]tid(ius) Murenian(us) TR( )       a) [..........]ius Paut(alia) | [..........] Sar(mizegetusa) | [......]nten(  ) Sar(mizegetusa) | [..........]us b(ene)f(iciarius) | c(onsularis) Am(pelo) | [.......]us[tu]s Sir(mio) | [......]ius cas(tris) | [...........] Rat(iaria) | [.....]x..a..us Ia[d(ero)] | [....] Titi[anus] cas(tris) | [....Ale]xan[der] Sc(upis) | [....S]aturn[i]n(us) Sa[r(mizegetusa)] | [....] Mestriu[s...] | [12] | [12] | [12] | B  [...]l(ius) Dolens Rat(iaria)', 12, 4, 5, 10, 18, -1, 4, 7, 58, 196, 2, 'druga polovina', NULL, NULL, NULL, 'osnova', 'mermer', '45:45:27', '', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 1, 1),
(258, 'IMS.2.54', '[Imp(eratori) L. Septimio Severo Pio Pertinaci Aug(usto) et Imp(eratori) Caes(ari) M. Aurelio Aug(usto) Pio Felici] | et Iuliae Dom[m]|nae matri cast(rorum) | vet(erani) leg(ionis) VII Cl(audiae) | Antoninianae | pro[b(ati) Poll]io(ne) et | Ap[ro co(n)s(ulibus)] m(issi) | h[on(esta) miss(ione) Imp(eratore) ] Severo | [et Anton(ino)] co(n)s(ulibus).', 14, 5, 5, -1, -1, -1, 4, 6, 35, 202, 3, 'prva polovina', NULL, NULL, NULL, 'ploca', 'mermer', '8:73:58', 'Sacuvan je samo donji deo ploce. Naziv Antoniniana koji nose trupe uobicajen je za Karakalinu epohu mada je u ovom slucaju sigurno rec o 202. godini.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 1, 1),
(259, 'IMS.2.55', '[Imp(erator) Caes.] Sept(imus) Severus Pert(inax) | [Pius F]elix Arab(icus) Adiab(enicus) | [Parth(icus) ] Maximus et | [Imp(erator) Caesar M.] Aur(elius) Antoninus Pius | [Felix Au]gustus cana|[bas refec]erunt leg(ionis) VII | Cl(audiae) [A]nt(oninianae) p(iae) f(idelis).', 14, 5, 5, -1, -1, -1, 4, 7, 19, NULL, 3, NULL, NULL, NULL, NULL, 'ploca', 'krecnjak', '24:85:60', 'Natpisno polje je u formi tabula ansata. Spomenik je otkriven 1896. godine i transportovan je kod Vajferta nakon cega je izgubljen.  Spominjanje kanaba dovodi se u vezu sa odlukom Septimija Severa da vojnici mogu ziveti sa svojom porodicom.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 1, 1),
(260, 'IMS.2.56', '] | [pro sal(ute) Imp(eratoris) Caes(aris) | M. Aur(elii) Antonini | Pii Aug(usti) F]elicis Par|[thici] Maximi Brit|[ann(ici)] Max(imi) Ger(manici) Max(imi) | [et Iul]iae Domnae | [Aug(ustae) m]atri () Aug(usti) et cas(trorum) | M. Anton(ius) Ponticus | dec(urio) flamen m(unicipii) A(elii) V(iminacii) | ob honor(em) flamon(ii) | ex libris L.', 14, 5, 5, 10, 6, -1, 4, 7, 19, 214, 3, 'prva polovina', NULL, NULL, NULL, 'osnova', 'beli mermer', '29.5:54:44.5', 'Do 1900. godine spomenik je bio deo kolekcije gimnazije u Pozarevcu. Nazivi Germanicus Maximus i  Felix kazuju da je u pitanju Karakala a ne Septimije Sever. Za flamen municipii videti i natpis IMS II 73. Oblik reci flamonium zastupljeniji je na natpisima od flaminium. Pretpostavlja se da je natpis nastao 214. godine kada je Karakala prosao dunavskim regionom na putu ka istoku.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 1, 1),
(261, 'IMS.2.57', 'Pro sal(ute) [Imp. Caes. | 12] | Anton[ini] | Pa[rt(hici', 11, 5, 5, -1, -1, -1, 4, 6, 59, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '::', 'Neizvesno je da li se natpis odnosi na Marka Aurelija ili Karakalu. Natpis je bio uzidan u Smeredevsku tvrdjavu CIL III 8111 ali mu se izgubio trag i ne zna se njegova trenutna lokacija.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 0, 1),
(262, 'IMS.2.58', '] | [pro salute | Imp(eratoris) Caes(aris) | M. Aur(elii) Seve|ri Alexan|dri Au]g(usti) n[ostri] | et leg(ionis) V[II] | Cl(audiae) Seve[ri]|anae A[lex]|andri[anae] | Myrism[us] | Felicis d[isp(ensatoris)] | vik(arius) lust[ro] | Cl(audii) Alex[an]|dri ha[s(tati)cum] | mensorib[us] | Iul(ius) Valens, Iul(ius) [4], | Fl(avius) Protus, Aur(elius) L[4], | Aur(elius) Iulianus, Ulp(ius) I[4], | Aur(elius) Viator, Val(erius) V[4], | Ael(ius) Aelianus, Aur(elius) P[4], | Au]r(elius) Pyrrus () [v(otum) s(olverunt) l(ibentes) m(erito)] | Modesto et Pr[obo co(n)s(ulibus)]', 14, 5, 5, -1, -1, -1, 4, 6, 59, 228, 3, 'prva polovina', NULL, NULL, NULL, 'spomenik', 'beli mermer', ':115:23.5', 'Legija VII Claudia nosi naziv Severiana Alexandriana i na natpisu iz Nisa IMS IV 3 i iz Donje Mezije Izvestija Balg. arch. druz. 2 1911 str. 179. Lustrum hastatinisu posvedoceni na drugim natpisima. Poznati su lustrum primipili i principis CIL III 14356a 14356b iz Karnuntuma J. Szilagyi Acta ant. hung. 1. 1951. str 196. iz Akvinkuma E Pais Suppl. CIL V 808 i 165 iz Akvileje. CIL XIII 6794 iz Mogontijakuma.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 1, 1),
(263, 'IMS.2.59', '] | [.....pr]o sa|[lute] Imp(eratoris) M. Aur(eli) | [Sev]er(i) Alex|and(ri) Aug(usti) Valer(ius) | Crescentio mil(es) | [le]g(ionis) IIII Fl(aviae) S(everianae) Ale[x(andrianae)] | v(otum) p(osuit) l(ibens) m(erito).', 11, 5, 5, -1, 24, -1, 5, 7, 11, 217, 3, 'prva polovina', 235, 3, 'prva polovina', 'zrtvenik', 'porozni krecnjak', '35:60:55', 'Natpis je otkriven 1972. godine. Kako je legija VII Claudia ucestvovala u ratovima Aleksandra Severa na istoku pretpostavlja se da se natpis moze datovati u 231. ili 232. godinu kada je legija IV Flavia bila stacionirana u Viminacijumu.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 1, 1),
(264, 'IMS.2.60', '[  pro salute] | Marciae Otaci|liae Severae | sanctissimae Aug(ustae) | coniugis d(omini) n(ostri) | Phillipi () Aug(usti) et | matris Philippi | nobilissimi Caes(aris) | et castrorum | domum suam et baln(eum) | refecit et paravit | Tib. Cl(audius) Marcellinus | eq(ues) R(omanus) DEC IIII () [5] | MAVR VN [10] | DEC () V [', 12, 5, 5, -1, -1, -1, 4, 6, 19, 247, 3, 'prva polovina', NULL, NULL, NULL, 'spomenik', '', '::', 'Natpis je bio u Malom gradu ugradjen u Smederevsku tvrdjavu. Unisten je najverovatnije eksplozijom 1941. godine. Tiberije Klaudije Marcelin najverovatnije je onaj eques Romanus i tribunus cohortis vigilum koji se javlja na natpisu iz 205. godine PIR II 1936 str 212 br. 921.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 1, 1),
(265, 'IMS.2.61', '[Pro salut]e Aug(usti) | C. Val(erius) Vi|bianus | nautar(um) | q(uin)q(uennalis) sig(num) Ma|tris deum et | ad restitu|tionem tem|pli Neptuni | s(estertium) II (milia) n(ummum) d(ono) d(edit).', 11, 5, 5, -1, 18, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'supljikavi krecnjak', '29:68:31', 'Nautarium quinquennalis najverovatnije se odnosi na kolegijum mornara. Mater deum posvedocena je samo u ovom natpisu. Posveta Neptunu pominje se na jos jednom natpisu iz Viminacijuma IMS II 38.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 0, 1),
(266, 'IMS.2.62', 'Imp(eratori) Caes(ari) C. Valer[io] | Aurel(io) Diocletian[o] | P(io] F(elici) Invicto Aug(usto) [', 11, 5, 5, -1, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik ili osnova', '', '55:175:85', 'Sacuvan je jos jedan natpis posvecen Dioklecianu i njegovim savladarima IMS II 9.', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 0, 1),
(267, 'IMS.2.63', '[In honorem] | imp. Caes. Aug(usti) | C. Memm[ius] Cyri[a]|cus [Au]g(ustalis) IIvira[libus | orna]m[e]n[ti]s....ab or[dine] | ...[e]t ab pr[dine...] in se con|latum statuam | arg(entaem) ex p(ondo) lib(ris) XL...    Mommsen', 14, 5, 5, -1, -1, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'spomenik', '', '::', '', 'zaKontrolu', 'sara', '2015-12-22', '2015-12-22', 0, 1),
(268, 'IMS.2.64', '] [p]ro sal(ute) | d(omini) n(ostri) Au[g(usti', 12, 5, 5, 10, 25, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'stub', 'beli mermer', ':15.5:22.7', 'Fragmenat je otkriven 1900. godine kod Kostolca nakon cega je premesten u kolekciju Pozarevacke gimnazije. Otkriveni fragmenat je verovatno bio deo stuba. cilindricnog kamena L. Jevremovic. AU se moze tumaciti i kao Aureliani Ladek Premerstein Vulic', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 0, 1),
(269, 'IMS.2.65', 'Im[p(erator)...| co[l(onia)', 12, 5, 5, 10, 26, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'ploca', 'mermer', '10:60:110', 'Spomenik je otkriven 1981. godine.', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 0, 1),
(270, 'IMS.2.66', 'p]ontifex [', 12, 5, 5, 10, 18, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'ploca', 'sivi krecnjak', '6:64:82', '', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 0, 1),
(271, 'IMS.2.67', '] | [.....C. Fulvi] | [[Plautiani]] pr(aefecti) p[r(aetorio) |  c(larissimi) ] v(iri) necessarii | dominorum n(ostrorum trium) | Flavius Optatus | proc(urator) Aug(ustorum trium)', 11, 5, 5, 10, 18, -1, 4, 7, 11, 197, 2, 'druga polovina', 205, 3, 'prva polovina', 'zrtvenik', 'krecnjak', '35.5:47:41', 'Spomenik je otkriven 1902. godine kod Kostolca premesten je prvo u selo Bradarac a zatim u Kostolac u Vajfertovu kolekciju. Trenutno se nalazi u Muzeju u Pozarevcu. Fulvije Plautijan bio je pretorijanski prefekt u periodu od 197. do 205. godine. i konzul 203. godine. Flavije Optat je bio prokurator Gornje Mezije i poznat je samo na osnovu ovog natpisa. Natpis je najverovatnije nastao 202. godine kada se Karakala ozenio sa Flavijom Plautilom. Moguce je da su se na natpisu pominjali i drugi clanovi porodice Plautijana. Plautijanovo ime je uklonjeno nakon 205. godine.', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 1, 1),
(272, 'IMS.2.68', 'Egnatius | Marinianus | leg(atus) Aug(usti) pr(o) pr(aetore).', 14, 5, 5, 10, -1, -1, 4, 7, 19, NULL, 3, NULL, NULL, NULL, NULL, 'osnova', 'beli mermer', '62:100:77', 'Spomenik je otkriven 1901. godine u Kostolcu. Neko vreme sae nalazio u Narodnom muzeju u Beogradu. Egnatije Viktor Marinijan se pominje na natpisu iz Gerase IGR III 1359 kao upravnik Arabije. Bio je konzul najranije 230. godine i upravnik Gornje Mezije oko 230. godine. Smatra se da je Egnatije bio Valerijanov tast i deda Galijenove zene Premerstein Vulic.', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 1, 1),
(273, 'IMS.2.69', 'M. Antoni(o) | M. f(ilio) Fabia | Fabiano proc(uratori) | XL Galliarum | et portus item | argentariar(um) | Pannonicar(um) | c(onductori) portori Illyrici | patrono bono | Mercator lib(ertus)', 14, 4, 5, 10, 18, -1, 4, 7, 11, NULL, 2, NULL, NULL, NULL, NULL, 'spomenik', 'beli mermer', '55:87:55', 'Spomenik se od oko 1905. godine nalazio u Vajfertovoj kolekciji. Kasnije je prebacen u Muzej u Pozarevcu. Fabijan je u vreme Hadrijana i Antonina Pija ili Marka Aurelija bio procurator XL Galliarum et portus zatim procurator argentariarum Pannonicarum i konacno conductor portori Illyrici.', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 1, 1),
(274, 'IMS.2.70', 'D(is) M(anibus) | Albinae | quae vix(it) | annis XV |  d(iebus) XXXVI | Albinus Iu|liorum ser(vus) | vil(icus) et Irene | parent(es) fil(iae) | carissim(ae) p(osuerunt).', 13, 5, 5, 10, -1, -1, 4, 7, 13, NULL, 2, NULL, NULL, NULL, NULL, 'stela', 'krecnjak', '6:37:110', 'Servus vilicus je verovatno imao odredjenu funkciju u poreskoj administraciji u Iliriku. Stoga se pretpostavlja da je ovaj nadgrobni spomenik nastao u periodu pre Marka Aurelija jer su od njegovog doba porez prikupljali carski prokuratori', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 1, 1),
(275, 'IMS.2.71', 'MAV | CFP | III vi[r a(ere) a(rgento) a(uro) gf(lando) f(eriundo) ] ili III vi[r capitalis] | tri[bunus laticl(avius) ] l[eg(ionis) ].', 16, 4, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'beli mermer', '40:85:39', '', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 0, 1),
(276, 'IMS.2.72', 'D(is) M(anibus) | Baebiae Am|oenianae | vixit annis | XXXIX C. Cassius | Niger dec(urio) mun(icipii) | Ael(ii) Vim(inacii) coniugi | b(ene) m(erenti) p(osuit).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Gentilicij Baebius srece se kod italskih doseljenika kao i u Dalmaciji i Liburniji kod romanizovanog autohtonog stanovnistva. Amenije je cest kognomen. Kasiji se pominju na jos nekim natpisima iz Viminacijuma IMS II 14 23 53 29a.', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 0, 1),
(277, 'IMS.2.73', 'D(is) M(anibus)  | C. Cornelius Rufus | dec(urio) augur mun(icipii) Ael(ii) Vim(inacii) | vixit ann(is) LXX | Ulpia Rufina uxor et | C. Corn(elius) Pacatus dec(urio) fl(amen) | mun(icipii) eiusdem et | Corneliae Rufina et | Bassa fil(iae) et hered(es) | b(ene) m(erenti) f(aciendum) c(uraverunt).', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '::', '', 'zaKontrolu', 'sara', '2015-12-23', '2015-12-23', 0, 1),
(278, 'IMS.2.74', 'D(is) M(anibus) | L. Licil(ius) ETEIL Hercula|nus dec(urio) aedil(is) mun(icipii) Ae[l(ii)] | Vim(inacii) vix(it) ann(is) XXXIII | Claudia Hygia | marito b(ene) m(erenti).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'sarkofag', 'beli krecnjak', '86:210:96', 'Sarkofag je otkriven 1882. godine.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(279, 'IMS.2.75', 'D(is) M(anibus) L. Quesidio C. filio Praesenti dec(urioni) et q(uin)q(uennali) primo mun(icipii) p..... Ael(ii) Dru(betarum) [et] dec(urioni) [mun(unicipii)] Vim(inacii). Vixit an(nos) LXIII. L. Quesid(io) Pr[ae]senti fil(io) ..... II vir(o) [q(uin)q(ennali) ] mu[n]i(cipii) Vim(inacii) s(uis)[q(ue) ]. H(ic) s(itus) e(st).        Mommsen', 13, 5, 5, -1, -1, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Nadgrobni spomenik je pronadjen u bunaru u Smederevu i transportovan je u beogradski Narodni muzej. Prema recima Domasevskog nestao je krajem XIX veka.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(280, 'IMS.2.76', '[D(is) ] M(anibus) | [7]ATI Restituti de[c(urionis) ] | [et ponti]ficis mun(icipii) Ael(ii) Vim(inacii) | [incomp]arabilis fili qui | [vixit ann(is) XXVI] men(sibus) II d(iebus) XXV et sibi | [vivus] 3] Telesphorus Aug(ustalis) mun(icipii) eius|[dem pater] felix dictus per eum pa|[ru]m sine eo.', 13, 5, 5, 10, -1, -1, 4, 7, 60, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'beli mermer', '8:61:85', 'Na natpisima iz Viminacijuma ime preminulog nakon formule DM cesce se nalazi u nominativu ili dativu. Spomenik je prenet u Bec 1837. godine.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(281, 'IMS.2.77', 'D(is) M(anibus) | Sex. Val(erio) Val(enti) | dec(urioni) mun(icipii) Ael(ii) | Vim(inacii) vix(it) an(nis) LXIII | Valerii Primus, Her|clianus () Valenti|nus heredes patri pientissimo b(ene) m(erenti) p(osuerunt).', 13, 5, 5, 10, -1, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '29:243:87', 'Ime preminulog je u dativu kao i na vecini nadgrobnih natpisa iz Viminacijuma. Herclianus umesto Herculianus posvedoceno je i na drugim primerima v. Kajanto Cognomina 215.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(282, 'IMS.2.78', 'D(is) M(anibus) | M. servius | Mani lib(ertus) | Thall(  ) Aug(ustalis) mun(icipii) | Ael(ii) Vim(inacii) vixit | ann(is) LXX | Manius Ser(vius) | S[i]lvanus fil(ius) et | heres b(ene) m(erenti) p(osuit).', 13, 5, 5, 10, 18, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', '', '24:200:70', 'Nadgrobna stela otkrivena je oko 1897. godine i prebacena je u Vajfertovu kolekciju. Danas se nalazi u Muzeju u Pozarevcu. Ime patrona glasi Manius Servius kako glasi i ime sina. Augustali se pojavljuju i na drugim natpisima iz Viminacijuma IMS II 63 76 84. Ime Thallus ili Thallion kao na natpisu iz Ulpijane CIL III 8185 cesto je kod oslobodjenika.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(283, 'IMS.2.79', '[ ] | L. Sevio | Rufo s(a)c(erdoti) | mun(icipii) Ael(ii) | Vim(inacii) vix(it) | ann(is) XLV | Saen(ia) Supe|ra coniug(i).', 13, 5, 5, 10, 27, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '34:123:66', 'Stela je otkrivena 1976. godine u selu izmedju Klicevca i Kostolca severno od mesta nekadasnjeg legijskog logora zajedno sa natpisom IMS II 88 i jednim fragmentom spomenika bez natpisa. Gentilicij Sevius ili Saevius rasprostranjen je u Italiji i zapadnim provincijama. U Dalmaciji se pomenuti gentilicij sretao kod doseljenika iz Italije. U Viminacijumu Sevius se pominje i na natpisu IMS II 118.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(284, 'IMS.2.80', '] [12]m | [.]d(us) sacerd(os) s[e] vivo m(onumentum) | p(osuit) in partem suam | m(onumentum) h(eredem) [n(on)] s(equetur).', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'ploca', 'sivi krecnjak', '16:69:144', '', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(285, 'IMS.2.81', '] | [  Pri]mitiva in mem(oriam) T. [  ] | [  ] mun(icipii) Aeli Vim(inaci). H(oc) [m(onumentum) h(eredem) n(on) s(equetur)].', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '::', 'U drugom redu pre municipi moglo bi stajati decurio II vir  Augustalis ili neka druga municipalna duznost.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1);
INSERT INTO `objekat` (`id`, `oznaka`, `tekstNatpisa`, `vrstaNatpisa`, `jezik`, `provincija`, `grad`, `mesto`, `pleme`, `modernaDrzava`, `modernoMesto`, `ustanova`, `pocetakGodina`, `pocetakVek`, `pocetakOdrednica`, `krajGodina`, `krajVek`, `krajOdrednica`, `tip`, `materijal`, `dimenzije`, `komentar`, `faza`, `korisnickoIme`, `datumKreiranja`, `datumPoslednjeIzmene`, `datovano`, `lokalizovano`) VALUES
(286, 'IMS.2.82', '2 II v]iro 3 4 [a]ig(ustalis) [mun]ic(ipii)    C. Torma', 16, 5, 5, -1, -1, -1, 4, 6, 44, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat spomenika', '', '::', 'U trecem redu umesto augustalis moglo bi da stoji i Augusti kao deo carske titule', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(287, 'IMS.2.83', ']cus() col(oniae) [  |  ]um et dec(urio) q(uin)[q(ennalis)  |  vixit a]nnis LII et Vale[rius  |  ]cius ()  MACAB [', 13, 5, 5, 10, 28, -1, 4, 7, 61, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'mermer', '3.5:24:52', 'Fragmenat ploce otkriven je 1977. godine u toku iskopavanja nekropole na mestu poznatom pod nazivom Kod grobalja. U drugom redu prva rec bi mogla glasiti praefectus fabrum.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(288, 'IMS.2.84', '[D(is)] M(anibus) | [.. F]elici q(ui) v(ixit) a(nnis) [  | di]ebus XV et | [  ]iano q(ui) v(ixit) a(nnis) | [  | do]ebus XXIII | [  ]mas Aug(ustalis) co[l)oniae) | Vim(inacii)  ]s et Vibia [l', 13, 5, 5, 10, -1, -1, 4, 7, 62, NULL, NULL, NULL, NULL, NULL, NULL, 'deo nadgrobnog spomenika', '', '25:166:56', 'Spomenik je iz Kostolca transportovan u Budimpestu. Godine 1957. vracen je Jugoslaviji.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 0, 1),
(289, 'IMS.2.85', 'Valeriae Hilarae | M. Aurel(ius) Timon (centurio) | leg(ionis) III Gall(icae) S(everianae) A(lexandrianae) con|iugi piissime () pos(uit).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, 3, NULL, NULL, NULL, NULL, 'sarkofag', 'krecnjak', '::', 'Sarkofag je otkriven 1804. godine.', 'zaKontrolu', 'sara', '2015-12-24', '2015-12-24', 1, 1),
(290, 'IMS.2.86', 'Q. Sicinio | Q. f(ilio) Serg(ia) | Maximo | X vir(o) stl(itibus) iud(icandis) | trib(uno) milit(um) leg(ionis) IIII F(laviae) f(elicis) | vixit ann(is) XXIII.', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'beli mermer', '22.5:250:88', 'Nadgrobna ploca je otkrivena u legijskom logoru u Viminacijumu. Kasnije je prebacena u Pozarevac a zatim joj se izgubio trag. Kvint Sicinije je bio pripadnik plebejskog staleza. Siciniji su retki u dunavskim provincijama i ime Sicinius pretezno je zastupljeno kod vojnika. Pored pomenutog iz Viminacijuma posvedocen je veteran iz Dakije CIL III 1606 i beneficijar iz Banja Luke CIL III 14221. Prema tipu spomenika natpis bi se mogao datovati u poslednje decenije I ili pocetak II veka.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(291, 'IMS.2.87', 'L. Aemilius L. f(ilius) Fab(ia) | Flaus Braca|ra| eq(ues) leg(ionis) IIII F(laviae) f(elicis) | stipend(iorum) XIIII | vixit ann(is) XXXII.', 13, 5, 5, 10, 26, -1, 4, 7, 63, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '30:200:70', 'Spomenik je otkriven 1980. godine na mestu nekadasnje nekropole. Kognomen Flaus rasporostranjen je u Spaniji. Od 102 primera ovog umena njih 59 se odnosi na spanske provincije Kajanto Cognomina 37. Ovaj kognomen posvedocen je u Dalmaciji kod vojnika kohorte I Lucensium poreklom iz mesta Lucus Augusti u Spaniji. Alfoldy PND 205.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(292, 'IMS.2.88', 'P. Publicius | Fabia Constas () | Brixxi(a) () e[q(es)] leg(ionis) IIII | F(laviae) f(elicis) t(estamento) f(ieri) i(ussit). H(ic) s(itus) est.', 13, 5, 5, 10, 27, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '35:195:72', 'Stela je otkrivena 1974. godine u selu Rit izmedju Kostolca i Klicevca severno od mesta nekadasnjeg legijskog logora zajedno sa natpisom IMS II 79 i jos jednim spomenikom bez natpisa. Sva tri spomenika iskoriscena su kao gradjevinski materijal za jednu pozniju grobnicu. Brixxia i FST umesto EST ocigledno su greske kamenoresca. Constas umesto Constans moze biti takodje greska ali i odgovara cestom vulgarizovanju jednog glasa up. Vales umesto Valens Clemes umesto Clemens i drugo Mihaescu Langue lat. 205. Broj regruta iz Briksije u doba carstva je prilican v. Forni Reclutamento 178 i ANRW II 1 1974 372. Triba Fabia odgovara gradu Briksija v. Kubitschek IRT 108.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(293, 'IMS.2.89', 'L. Caesius L. f(ilius) | Anie(nsi) Flaccus | Caesara () Aug(usta) | (centurio) leg(ionis) IIII F(laviae) f(elicis) vix(it) | [a]nn(is) X[', 13, 5, 5, 10, 18, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'gornji deo nadgrobnog spomenika', 'beli mermer', '16:95:80', 'Spomenik je pronadjen krajem XIX veka u Cairu. Grad Caesaraugusta nalazi se u Tarakonskoj Spaniji. Za tribu Aniensis v. Kubitschek IRT 258.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(294, 'IMS.2.90', 'D(is) M(anibus) | Calliope ancil|le () L. P( ) Gaiani | (centurionis) leg(ionis) IIII Fl(aviae) | L. P( ) Vacinth|us coniugi dul(cissimae) | m(onumentum) p(osuit) v(ixit) a(nnis) XVIII.', 13, 5, 5, 10, 26, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni zrtvenik', 'supljikavi krecnjak', '43:108:60', 'Zrtvenik je otkriven 1964. godine.  Za Calliope i ancille sa krajnjim samoglasnikom e longa u dativu  v. Mihaescu Lasngue lat. 172. O robovima u posedu vojnika i veterana v. IMS II Intr. 45.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(295, 'IMS.2.91', 'Non(ius) SAI[....]GNUS qui | et signo Dalmatis () b(ene)f(iciarius) con(sularis) | leg(ionis) IIII Fl(aviae) vix(it) an(nis) XXXX me(n)s(ibus) III | die(bus) XVIII stip(endriorum) XXIII Iulia Eraclia () | coniugi bene merenti posuit.', 13, 5, 5, 10, -1, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'sarkofag', 'pescar', '100:234:124', 'Sarkofag je transportovan u Beograd 1948. godine. Jedan Nonius javlja se i na natpisu IMS II 141. Gentilicij Salonius kako bi mogao glasiti Nonijev gentilicij prema Romeru Arch. kozl. 6. 1866 166. i CIL III 6300 posvedocen je u Dalmaciji v. Alfoldy PND 103. Ime Dalmatius ovde se javlja kao supernomen. Kao kognomen javlja se na poznijem natpisu IMS II  143.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(296, 'IMS.2.92', 'D(is) M|(anibus) Ael(io) Victorino | VE infelicissimo iueni () | qui vixit annos XXV m(enses) | VIIII dies VII Aelius Procu|linus signif(er) leg(ionis) IIII Fl(aviae) | fratri piissimo | b(ene) m(erenti).', 13, 5, 5, 10, -1, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'mermer', '18:155:99', 'Spomenik je otkriven zajedno sa IMS II 106 u jednoj poznijoj grobnici. VE u drugom redu teksta moglo bi se tumacii kao viro egregio s tim sto se F iza V u tom slucaju mora tumaciti kao greska.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(297, 'IMS.2.93', 'C. Refidius C. l(ibertus) | Eutychus fa|ber arg(entarius) vixit | [10] | h(ic) s(itus) e(st) | C. Refidius Rufus | optio leg(ionis) IIII F(laviae) f(elicis) | h(oc) p(osuit).', 13, 5, 5, -1, -1, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'mermer', '::', 'Spmenik je prema recima Marsilija otkriven u Smederevu u turskoj grobnici. Ime Refidius retko je u podunavskim provincijama. Dva primera su poznata u Panoniji CIL III 3869 iz Emone i CIL III 14074 iz Karnuntuma.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(298, 'IMS.2.94', 'D(is) M(anibus) | Genis Domiti | vix(it) ann(is) LX et Affu|ti Aristonis con|iugi eius vivo Ael(ius) | Domitianus im|munis lib(rarius) leg(ionis) IIII | Fl(aviae) parentibus pi|issimis [po]suit.', 13, 5, 5, -1, -1, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Natpis je bio uzidan u Smederevsku tvrdjavu prema CIL III 8120  ali nije pronadjen.', 'zaKontrolu', 'sara', '2015-12-25', '2015-12-25', 0, 1),
(299, 'IMS.2.95', '[D(is) ] M(anibus) | L. Paterno | T. f(ilio) Ianuar|[i]o vet(erano) leg(ionis) IIII | [Fl(aviae) ] et Iuniae | [Ianu]a[r]iae | [Pa]ternia | [Ian]uaria | [fil(ia) e]t here[s  ] | II V [', 13, 5, 5, -1, -1, -1, 4, 6, 59, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Nadgrobni spomenik je uzidan u Smederevsku tvrdjavu ali mu se izgubio trag.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(300, 'IMS.2.96', 'a)   Maxi[mus | leg(ionis) III]I F(laviae) f(elicis)   M. Mirkovic     b) .... | ... vix(it) a[nn(is)...   N. Vulic', 13, 5, 5, 10, 29, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenti nadgrobnog spomenika', 'krecnjak', '20:23:15', 'Vulic je predlozio drugacije citanje prvog fragmenta Maximus legionis III Flaviae firmae. Dimenzije drugog fragmenta su 20 10 23', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(301, 'IMS.2.97', 'a)  Papiria | [F]lac[co  b) [t]u[b(icini) leg(ionis) III]I Fl(aviae) Ful[viae]', 16, 5, 5, -1, -1, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, '', '', ':25:27', 'Premerstajn i Vulic su smatrali da su ova dva fragmenta pripadala istom spomeniku. Dimenzije drugog fragmenta su 17 26.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(302, 'IMS.2.98', 'D(is) M(anibus) | M. Fabio capreolo | liberto optimo | M. Fabius Pate[r]|nus trib(unus) leg(ionis) VII Cl(audiae) | patronus.', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'beli mermer', ':29:29', 'Nadgrobna ploca je otkrivena oko 1870. godine u Kostolcu i transportovana u Klenovik gde je iskoriscena za poplocavanje kuce Milana Ognjanovica. Fabije Paternus je mogao biti u nekakvom srodstvu sa Fabijem Kilom koji je bio upravnik Gornje Mezije  od 195 do 196. godine', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(303, 'IMS.2.99', '] d[i]ebu[s . . . dec(essit) ho]ra noc[t]urn(a) VII | Aur(elius) Felicianus pr(inceps) leg(ionis) VII Cl(audiae) | coniugi dignissimae.', 13, 5, 5, -1, 30, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'donji deo sarkofaga', 'beli mermer', '64:152:25', 'Formula decessit  zajedno sa spominjanjem casa smrti cesta je u periodu Poznog carstva. Scena zrtvovanja Ifigenije na sarkofagu mozda upucuje na to da spomenik ne treba datovati u period posle Konstantina .', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(304, 'IMS.2.100', 'D(is) M(anibus) | Tib. T[et]tius | Euph[e]mianus | p(rimus) p(ilus) leg(ionis) VII [C]l(audiae) hic | sit[us e]st | Fulvia C[hr]ysis mari|to pien[ti]ssimo.', 13, 5, 5, 10, 31, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'deo sarkofaga', '', '18:109:186', 'Ime Tettius posvedoceno je u svim podunavskim provincijama od Norika do Donje Mezije up. CIL III Index. Ime vojnika legije IV Flavia u Eskusu CIL III 7425.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(305, 'IMS.2.101', 'L. Oppius T. f(ilius) | Cla(udia) Secun|dus Varvar(ia) | p(rimus) p(ilus) leg(ionis) VII C(laudiae) | praef(ectus) k(astrorum) le[g(ionis)] | VII C(laudiae) p(iae) f(idelis).', 13, 5, 5, -1, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'ploca', 'krecnjak', '40:119:80', 'Varvaria se ne javlja sa tribom Klaudija osim na ovom natpisu. O Varvariji v. Wilkes Damatia 217. Natpis je pretvoren u poklopac sarkofaga vec u anticko doba.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(306, 'IMS.2.102', 'D(is) M(anibus) | Aurel(ius) Ale|xander (centurio) | leg(ionis) VII Cl(audiae) et Iul|lia Onesime | coni(us) eius Au|relianeni | alumnae | suae bene | merenti po|[suerunt].', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'ploca', 'beli mermer', '48:45:30', '', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(307, 'IMS.2.103', '[D(is) ] M(anibus) | [..] Iuli Quin|[t]i (centurioni) leg(ionis) VII | [Cl(audiae). . .]IACA | [fil]ia [', 13, 5, 5, -1, -1, -1, 4, 6, 64, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobnog spomenika', '', '::', '', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(308, 'IMS.2.104', '] | [8]NOCI | [6]usto ex | [6] Carthag(iniensi) | [2] O.I[. .so]rores | heredes [op]timo piis|simo amantissimo fra|tri fecerunt. [P]ius vix(it) an(nis) LXV | (centurio) mil(itavit) an(nis) XXXV. H(ic) s(itus) e(st). Ex his agris | monimento ex[ce]pti sunt in fro(nte) | p(edes) XX introitus [p(edes)] XX et iter.', 13, 5, 5, 10, -1, -1, 4, 7, 58, NULL, NULL, NULL, NULL, NULL, NULL, 'deo nadgrobnog spomenika', 'meki krecnjak', '97:91:76', 'Nadgrobni spomenik je u obliku cipusa. U Muzeju u POzarevcu nalazi se samo fragmenat spomenika dok su ostali delovi izgubljeni. Za oblik reci monimento umesto monumento v. Mihaescu Langue lat. 182.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(309, 'IMS.2.105', '[D(is) ] M(anibus) | [8]rinae ra|[rissimi exem]pli femi|[nae quae vix(it) an(nis) . .] XVIIII m(ensibus) V | [6]anus (centurio) | [leg(ionis) 4 coni]ugi ka[rissimae   ]', 15, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat sarkofaga', 'krecnjak', '9:67.5:65', 'M. Mirkovic prenosi citanje Premerstajna i Vulica osim u sestom redu gde oni citaju legionis VII Clauidae dok ona pominje mogucnost da se radi o legiji IIII Flavia.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(310, 'IMS.2.106', 'D(is) M(anibus) | L. Blassius Nigellio | specul(ator) leg(ionis) VII Cl(audiae) vixit | ann(is) XXXV.', 13, 5, 5, 10, -1, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'mermer', '30:175:132', '', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(311, 'IMS.2.107', 'D(is) M(anibus) | Aurel(ius) Sene|cianus b(ene)f(iciarius) co(n)s(ularis) | vix(it) ann(is) XLV | Ulp(ia) Faustina | coiux () et Aur[el(ia) ] | Firmina [fil(ia) ] | posu[er(unt) ].', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'beli mermer', '4.5:36:30', 'Senecijan i imena sa istim korenom rasprostranjena su u keltskim zemljama. Kajanto Cognomina 301.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(312, 'IMS.2.108', '[  ] | Iuliae [.] | BITE vix(it) | ann(is) XIIII | Iuli[u]s Ia|nu[ari]us | b(ene)f(iciarius) co(n)a(ularis) | lib(ertae) b(ene)m(erenti) p(osuit). | H(ic) s(ita) e(st).', 13, 5, 5, -1, -1, -1, 4, 6, 35, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'krecnjak', '30:69:68', 'Spomenik je otkrio arheolog Marko Popovic 1980. godine u toku iskopavanja oko Smederevske tvrdjave.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(313, 'IMS.2.109', 'D(is) M(anibus) | C. Pomponi|us Valerian|us mil(es) leg(ionis) | VII Cl(laudiae) b(ene)f(iciarius) co(n)s(ularis) | vix(it) an(nis) XXVIII | mil(itavit) an(nis) X [. . .]|va Pomponia | soror et [', 13, 5, 5, 10, 6, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'sivi krecnjak', '17:107:74', 'Gentilicij Pomponii rasprostranjen je svuda Schulze LE 212. mada je ovo jedini primer posvedocen u Gornjoj Meziji.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(314, 'IMS.2.110', 'D(is ) M(anibus) | M. Val(erius) Speratus | vet(eranus) leg(ionis) VII Cl(audiae) ex b(ene)f(iciario) | co(n)s(ularis) dec(urio) m(unicipii) A(elii) V(iminacii) praef(ectus) coh(ortis) | I Aquet(anorum) () v(ixit) a(nnis) LV o(biit) in Britt(annia) () | Lucia Afrodisia () con|iugi b(ene) m(erenti) et sibi vivae | posuit.', 13, 5, 5, 10, -1, -1, 4, 7, 50, NULL, 3, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'mermer', '20:157:75', 'Spomenik je otkriven oko 1890. godine u Kostolcu. Prebacen je najpre u Pozarevac a zatim u Pancevo. O karijeri Valerija Sperata v. Mocsy Moesia Superior 162 Birley Ep. Studien 8 1969 75. Isto ime nosi jedan optio legije VIII Augusta iz Lambeze CIL VIII 2554. Cohorta I Aquitanorum posvedocena je u Gornjoj Germaniji oko 70. godine i u II veku. Moguce je da se privremeno nalazila u Britaniji za vreme kampanje Septimija Severa i izgradnje zidina. v. Wagner Dislokation 86 i dalje. Benes Auxulia Romana in Moesia atque Dacia 1978 16 i dalje.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 1, 1),
(315, 'IMS.2.111', '[  ] co(n)s(ularis) | [  ] XV et | [  ]it | [  ] | [  ]it.', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'beli mermer', '17:24:14', 'Vulic je izneo pretpostavku da bi u prvom redu moglo stajati beneficiarius consularis u drugom vixit... a u trecem militavit.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(316, 'IMS.2.112', '[  ] | [  mil(itavit) ] | an(nis) XXIII vix(it) an(nis) | XLVIII Fl(avius) Palma b(ene)f(iciarius) | leg(ati) her(es) b(ene) m(erenti) p(osuit).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'beli krecnjak', '28:60:94', 'Ime Palma verovatno ima veze sa biljko i simbolizuje pobedu. U tom slucaju ime bi bilo ekvivalentno sa imenom Victor. Kajanto Cognomina 89.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(317, 'IMS.2.113', 'Parvolus | hic situs est | Ulp(ius) Iovinus | nomine qui vi|xit ann(is) V m(ensibus) VI  | d(iebus) XXIII. Hic solus | pater hunc hu|mav[i]t parvolum | cuius de[s]iderio | lumen intentus | dolet Ulp(ius) Vale|rianus b(ene)f(iciarius) leg(ati) pa|ter a quo sibi sperab(at).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'sivi krecnjak', '14:204:89', 'Natpis pocinje kao metricka fraza. Drugi deo teksa takodje ima poeticnu intonaciju ali znacenje ostaje nejasno. Pridev intentus verovatno se odnosi na oca.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(318, 'IMS.2.114', '] b(ene)f(iciarius) l(egati) | [  ]  PR', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'beli mermer', '1.5:5:5.5', '', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(319, 'IMS.2.115', 'D(is) M(anibus) | Aur(elius) Marcia|us () sta(tor) leg(ati) leg(ionis) | VII C(laudiae) st(ipendiorum) XXVI | Cutius an(norum) XIII | Aprilis an(norum) XII IV [.] | LISRISCRIANI | APRIA st(ipendiorum) X | Aurelia Cutia | coniug(i) et filis et | nepot(i) et Hel(vius) Oc|tavianus nepos | her[es] auncul(o) () | et con[t]ub(ernalibius) pos(uerunt) | Antiochano () et Orfito con(n)s(ulibus).', 13, 5, 5, -1, -1, -1, 4, 6, 44, 270, 3, 'druga polovina', NULL, NULL, NULL, 'nadgrobni spomenik', 'krecnjak', ':121:63', 'Imena Kutijus i Kutija verovatno su keltska. v. Holder Sprachschatz I 1207. Ime Kutije javlja se na kalendaru Kolinjija za jedan mesec up. Dottin La langue gauloise 250. Zanimiljivo je primetiti da drugo dete vojnika nosi ime takodje po mesecu April.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 1, 1),
(320, 'IMS.2.116', 'D(is) M(anibus) | C. Val(erius) Maxi|mus vet(eranus) l[e]g(ionis) | VII Cl(audiae) ex corn(iculario) | trib(uni) vix(it) ann(is) | [.]VII Aebutia | [T]aburtilla | [  ] et [V]ale | [  ] | b[  ] p[osuit].', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', '', '15:93:80', 'Sacuvano je jedanaest fragmenata ploce od kojih se osam podudaraju. Gentilicij Aebutius dosta je rasprostranjen u Italiji v. A. Calderini Aquileiua Romana 1939 445. i posvedocen je u Dalmaciji Alfoldy PND 54 i u Gornjoj Meziji u Racijariji Mocsy Onomasticon 145. Ime Taburtilla ukoliko je tacna pretpostavka o rekonstrukciji imena dosta je retko. Ime Taburnius CIL IX 1291 moglo bi biti od istog korena.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(321, 'IMS.2.117', 'D(is) M(anibus) | C. Iulio Valen|ti mil(iti) leg(ionis) VII Cl(audiae) | b(eneficiario) proc(uratoris) stip(endiorum) XXV vi|xit ann(is) L. L. Iulius | Valens fil(ius) et | heres facien|dum curavit. | H(ic) s(itus) e(st).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Otac i sin nose isto ime sto je redak slucaj na natpisima iz Gornje Mezije. Moguce je da se otac zvao Valentinianus.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(322, 'IMS.2.118', 'D(is) M(anibus) | Vivite felices nostris|que profundite Manis | et memores sitis nobis|cum vos esse futuros. | Seviae Aquilinae con|iugi Aur(elius) Marinus b(ene)f(iciarius) | b(ene) m(erenti) p(ossuit).', 13, 5, 5, 10, 18, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'sarkofag', 'krecnjak', '248:102:70.5', 'Sarkofag je prepolovljen na dva dela. Bocne strane razlikuju se po duzini i sirini. 102 i 70.5 248 i 210 132. Ime Sevius javlja se i na natpisu  IMS II 79.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(323, 'IMS.2.119', 'D(is) M(anibus) | M. Aurel(io) Dizzi|ni aquilifero | leg(ionis) VII Cl(audiae) vixit | ann(is) XLVI Flavia | Nata coniux et | Flavia Viatorina | filia heredes | b(ene) m(erenti) p(osuerunt).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'sivi krecnjak', '26:178:69', 'Tracko ime Dizzo onis dosta je rasprostranjeno. v. Detschew Thr. Sprachr. 133. Ime Viatorianus. a takodje je posvedoceno Kajanto Cognomina 362.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(324, 'IMS.2.120', 'D(is) M(anibus) | T. Aur(elio) Mer|catori vet(erano) | ex imag(inifero) leg(ionis) | VII Cl(audiae) vix(it) ann(is) | L et Aur(elio) Marci|ano mil(iti) leg(ionis) | eiusd(em) vix(it) ann(is) | XXX mil(itavit) ann(is) V | T. Aur(elius) Quintus vet(eranus) | leg(ionis) eiusd(em). H(ic) p(ositi) s(unt).', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'mermer', '5:49.5:19', 'Nadgrobna ploca prepolovljena je na dva dela. Gornji deo pronadjen je 1961. godine u Kostolcu a donji 1963. godine u selu Stari Kostolac.', 'zaKontrolu', 'sara', '2015-12-29', '2015-12-29', 0, 1),
(325, 'IMS.2.121', 'D(is) M(anibus) | L. Aur(elius) Andro|nicus vet(eranus) ex | signifero leg(ionis) VII Cl(audiae) vix(it) a(nnis) LIII | L. Aur(elius) Salvia|nus libr(arius) co(n)s(ularis) | filius.', 13, 5, 5, 10, -1, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'mermer', '20:172:80', 'Stela je otkrivena 1890. godine u polju Ljube Jeftica u Kostolcu. Sekundarno je upotrebljena kao materijal za pozniju grobnicu. Iako se stela ne moze precizno datovati na osnovu carskog gentilicija kod pokojnika i njegovog sina moze se zakljuciti da spomenik nije strariji od kraja II veka. Dve glave bika na gornjem delu stele predstavljaju simbol legije VII Claudia.', 'zaKontrolu', 'sara', '2016-01-11', '2016-01-11', 0, 1),
(326, 'IMS.2.122', '] | [  ] IVSA III [faciend(um)] | curavit C. Terentius C. f(ilius) | Cl(audia) Catullus Vir(uno) vet(eranus) leg(ionis) VII Cl(audiae) | p(iae) f(idelis) ex sig(nifero) contirun[c]u[l]o et | contubernali pientissimo | Crispino [et Iulian]o II [co(n)s(ulibus)].', 13, 5, 5, -1, -1, -1, 4, 6, 19, 224, 3, 'prva polovina', NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Contirunculus je dugo smatrana za hapax legomenon sve do 1962. godine kada je otkriven jos jedan natpis koji sadrzi ovu rec IMS I 28. Contubernalis je termin koji se cesto javlja na vojnim natpisima CIL III 2390 3150 IlIug. I 184 itd. Gaj Terencije Katul je vojnik koji je bio regrutovan zajedno sa pokojnikom. Za vojnike regrutovane u Virunumu v. Forni Reclutamento 193.', 'zaKontrolu', 'sara', '2016-01-11', '2016-01-11', 1, 1),
(327, 'IMS.2.123', 'D(is) M(anibus) | M. Aurel(ius) Rufus | tess(erarius) leg(ionis) VII Cl(audiae) | vix(it) ann(is) XL milit(avit) | ann(is) XX Aurel(ius) | Longinus et Au|rel(ius) Aulutral[i]s | milites leg(ionis) ei|ustem () conh|eredes b(ene) m(erenti) p(osuerunt).', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '32:216:90.5', 'Jedan tessesarius legionis VII Claudiae Severianae Antoninianae poznat je na natpisu iz Bugarske Izvestija balg. arch. druz. 2 1911 179.', 'zaKontrolu', 'sara', '2016-01-11', '2016-01-11', 0, 1),
(328, 'IMS.2.124', '] | [ C. Domitio ] | C. [f. . .]RICULO [..] c(ustodi) a(arorum) | leg(ionis) VII [C]l(audiae) vixit | annis XXXXII | et Neriae Claudiae vi|xit annis [X]XVII | coniugti eius | Domitia Anthusa | mater et | Domitii Digna, Po|tentius, Ingenua, | Potentina, Surren|tus [fil]ii et Domit(ius) Iuli|us ne[pos] benemeren|ti(bus) posuerunt.', 13, 5, 5, 10, -1, -1, 4, 6, 44, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'crvenkasti kamen', '27.5:90:81', '', 'zaKontrolu', 'sara', '2016-01-11', '2016-01-11', 0, 1),
(329, 'IMS.2.125', '] | [10] S | [8 le]g(ionis) VII | [Cl(audiae) vix(it) an]n(is) XXXXV | [milit(avit) an]n(is) XXII | [4 M]axi|[minian]us ar|[matura le]g(ionis) ei|[usde]m her(es) | [b(ene) m(erenti)] p(posuit).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobnog spomenika', 'pescar', '34:11.5:45.5', '', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(330, 'IMS.2.126', 'D(is) M(anibus) | Aur(elius) Vitalis veter(anus) ex | mensore tritici | leg(ionis) VII Cl(audiae) et Aurel(ia) | Macedonia coniux | memoria(m) vivi fabrikabimus () | et quod nescientes | accepimus inviti reddidimus. Tauta.', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'pravougaona ploca', 'mermer', '85:59:109', 'Zensko ime Macedonia retko se javlja na latinskim natpisima dok je musko ime Macedo ucestalije v. indeks u CIL III. Rec tauta na kraju reda upucuje na vezu sa helenofonim svetom. Uz ovu grcku zamenicu podrzaumevaju se reci ho bios i zajedno bi se moglo prevesti sa To je zivot ili slicno. Ova formula se moze videti i na jednom natpisu iz Singidunuma IMS I 71. Aurelija Makedonija je verovatno bila oslobodjenica i nosi isto gentilno ime kao i njen muz.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(331, 'IMS.2.127', 'D(is) M|(anibus) | P. Ael(ius) Priscus | mil(es) leg(ionis) VII Cl(audiae) | stip(endiorum) XXV v(ixit) a(nnis) L | P. Ael(ius) Ursulus | fil(ius) et P. Ael(ius) Ca|pito lib(ertus) | heredes f(aciendum) c(uraverunt).', 13, 5, 5, 10, 6, -1, 4, 7, 38, NULL, NULL, NULL, NULL, NULL, NULL, 'pravougaona ploca', 'krecnjak', '8:46:38', 'Ploca je preneta u Beograd oko 1887. godine.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(332, 'IMS.2.128', 'D(is) M(anibus) | L. Cassianus Potens mil(es) | leg(ionis) VII Cl(audiae) p(iae) f(idelis) | mil(itavit) annis XI | vixit annis | XXVIII Cassia(na) | Valentina | b(ene) m(erenti) fratri | posuit.', 13, 5, 5, 10, 18, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'krecnjak', '26:230:76', 'Cassianus je kognomen koji je u upotrebi kao gentilno ime.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(333, 'IMS.2.129', 'D(is) M(anibus) | P. Ael(ius) Antio|chus veter(anus) | leg(ionis) VII Cl(audiae) v(ixit) a(nnis) | LX et P. Aelius | Donatus alm|nus () eius v(ixit) a(nnis) VII | P. Ael(ius) Agathan|gelus et P. Ael(ius) | Primitivos () lib(erti) | et heredes | f(aciendum) c(uraverunt).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '3:153:82', 'Kognomen Antiochus javlja se na jos jednom natpisu iz Viminacijuma IMS II 161.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(334, 'IMS.2.130', 'D(is) M(anibus) | M. Aur(elius) Helio|dor(us) vet(eranus) leg(ionis) | VII Cl(audiae) vix(it) an(nis) | XXXXVI milit(avit) | ann(is) XXVI | M. Calidi(us) Bass(us) | et M. Ulp(ius) Maxim(us) | her(edes) b(ene) m(erenti) p(osuerunt).', 13, 5, 5, 10, 25, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'ploca', 'zuckasti mermer', ':72:27.5', '', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(335, 'IMS.2.131', 'D(is) M(anibus) | Q. Helvius Probus | vet(eranus) leg(ionis) VII Cl(audiae) | vix(it) ann(is) LIII | H(ic) s(itus) e(st) | Pontia Optata | coniugi suo pi|ent(issimo) ben(e) mer(enti) pos(uit) | Q. Helvius Optatus | [patr(i) s]uo [be(ne)] mer(enti) | [posuit],', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '40:223:91', 'U Gornjoj Meziji ovo je jedini natpis na kome je posvedocen gentilicij Helvius. Mocsy Onomasticon 147. Ovaj gentilicij posvedocen je vise puta u Dalmaciji kod doseljenika iz Italije gde je ovo ime rasprostranjeno. Alfoldy PND 89. Pontii su posvedoceni i u Racijariji CIL III 8090 i u Ulpijani kod pripadnika senatorskog staleza CIL III 8169 i Jaresh. 6. Beibl. 26.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(336, 'IMS.2.132', 'D(is) M(anibus) | Oppiae Aga|then[i] matri | v(ixit) a(nnis) LX et Iul(io) | Quadrato | pat(ri) ve[t(erano)] leg(ionis) VII | Cl(audiae) v(ixit) a(nnis) LXV Hercula|no frat(ri) v(ixit) a(nnis) VIII | Iul(ius) Bassus m(iles) leg(ionis) I. II P () | s(  ) co(n)s(ularis) b(ene) m(erentibus) p(osuit).', 13, 5, 5, 10, 30, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', '', '::', 'Gentilicij Oppius javlja se i na natpisu IMS II 101.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(337, 'IMS.2.133', 'D(is) M(anibus) | L. () Val(erio) Quin|[t]ino vet(erano) leg(ionis) | [VII] Cl(audiae) vix(it) ann(is) | XLV et L. Val(erio) Cel|so mil(iti) leg(ionis) VII Cl(audiae) | vix(it) an(nis) XX m(ilitavit) ann(is) II | Licinia Cel|sina coniu|gi karissi[mo] | et fil(io) incom|parabili | b(ene) m(erentibus) p(osuit) | H.S.M.E.', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni cipus', 'supljikavi pescar', '51:104:71', 'Skracenicu H.S.M.E. Vulic je tumacio kao Hoc sibi memoriae est. M. Mirkovic dodaje da bi se skracenica mogla tumaciti i kao Hic siti memores estote.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(338, 'IMS.2.134', 'D(is) M(anibus) | M. Val(erius) Va|lens Fab(ia) | Eracl(ea) () ve[t(eranus)] | [leg(ionis) VII Cl(audiae) p(iae) f(idelis)] | vix(it) an(nis) LXX | Val(eria) Vener(ia) | lib(erta) patro[no] | b(ene) m(erenti) et s[ibi pos(uit)].', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'krecnjak', '26:193:63', 'Vojnik je verovatno poreklom iz Herakleje Sintike ili Herakleje Linkestide. Triba Fabija posvedocena je za oba mesta. v. Papazoglou Heraclee I 1961 17.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(339, 'IMS.2.135', '] | [  le]g(ionis) VII Cl(audiae) p(iae) [f(idelis)] | [vixit an(nis)   milit]avit an[n(is)  ] | Eli[  ] | [con]iugi be[ne merenti | et sibi viva po]suit.', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobne ploce', 'krecnjak', '23:43:46', 'Tekst su rekonstruisali Vulic i Premestajn.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(340, 'IMS.2.136', '] | ni [10] | ETVI IR[  ] | leg(ionis) VII Cl(audiae) vix(it) | ann(is) XXXVII | Laricia quae | et Meter coiu|gi () piissimo | b(ene) m(erenti) p(osuit).', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'pescar', '56:109:82', 'Spomenik je otkriven 1899. godine u Cairu. Za gentilicij Laricius v. Schulze LE 340.  Kognomen je odvojen od gentilicija recima qui et kao da je u pitanju agnomen v. Kajanto Supernomina 40. Ovo je cesta upotreba kod novih gradjana.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(341, 'IMS.2.137', '. .]us Eu[ . .] | [. . ]tius ROT[. . ] | [. . ] leg(ionis) VII C[l(audiae) . . ] | [. . ]AN | [ . .', 16, 5, 5, 10, 26, -1, 4, 7, 61, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat spomenika', 'mermer', '5:28:25', 'Fragmenat je otkriven 1983. godine.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 0, 1),
(342, 'IMS.2.138', '. . ] | [. . .] I [. .]IAR () | annor(um) XXV | H(ic) s(  ) e(st) | L. Fabius Cres|cens (centurio) leg(ionis) XV | Apol(linaris) lib(  ) | [b(ene) ] m(erenti) p(osuit).', 13, 5, 5, 10, 26, -1, 4, 7, 61, 86, 1, 'druga polovina', 106, 2, 'prva polovina', 'nadgrobna stela', 'krecnjak', '22:105:72', 'Stela je otkrivena 1981. godine. Ime Fabije javlja se na jos jednom spomeniku iz Kostolca IMS II 98. Legija XV Apollinaris posvedocena je na istoku do 71. godine i ponovo krajem Trajanove vladavine dok je u medjuvremenu ucestvovala u ratovima sa Dacanima na Dunavu u vreme Domicijana ili Trajana.', 'zaKontrolu', 'sara', '2016-01-12', '2016-01-12', 1, 1),
