(346, 'IMS.2.142', 'Sabinianus | pro(tec)tor ortus in | provincia Dardania | reg(ione) Ulpiane(nsi) [. . .] | DASA  qui vixit an(nis) L | qui donec superstaret | vitam iucundam exegi | sibi et amicis qui a me | hodie exoptantus | et optantur. Ibidem | terra levis habeat sem|[per] vosque iter carpite le|gite [. . .] | vos vitam iucundam ex[i]|gatis. post mortem nihil e|st nisi est vilis umbra vox () | [bp]ne () memoriae castaqu[e] | [. . .       (vertikalno)      Sulpitus posuit.', 13, 5, 5, 10, -1, -1, 4, 7, 19, 250, 3, 'druga polovina', 350, 4, 'druga polovina', 'nadgrobna ploca', 'beli krecnjak', '26:93:52', 'Ploca se datuje u III ili IV vek Prosop. LRE 781. BR 1. ili u drugu polovinu III veka. Dusanic smatra da nista ne ukazuje na IV vek Dusanic Vojnicki natpisi 62. br 31. M. Mirkovic smatra da je natpis nastao posle 290. godine kada je protector postao cin koji otvara oficirsku karijeru. A. H. M. Jones Later Roman Empire 636 sqq. Pre Dioklecijana protektori se kavljaju kao protectores Augusti ili Augustorum up. Mommsen Protectores Augusti Ges. Schrift. VIII 426. a kasnije samo kao protectores. Cinjenica da se Dardanija javlja kao provincija takodje upucuje na Dioklecijanovo ili poznije doba kao vreme nastanka natpisa.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 1, 1),
(347, 'IMS.2.143', 'D(is) M(anibus) Fl(avius) Dalmatius | p(rae)p(ositus) vicsit () annis LX | per instantiam | BVT [.]ICICANIS EGIT | [. .] VRIENTE L EI', 13, 5, 5, 10, 32, -1, 4, 7, 13, NULL, 4, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'krecnjak', '19:40:43', 'U trenutku otkrivanja ploce njena duzina je bila 95 sm. Na IV vek upucuju oblik slova Oremerstein Vulic Jahresh. 3 1900. Beibl. 123 124 br 19. i titula praepositus Grosse Militargeschichte 143.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 1, 1),
(348, 'IMS.2.144', '[F(lavius] Valer[ianus tri]|bunus [ sagittario]|rum Hem[esenorum] | fabrica[m. . .] | ordina. . .   Premerstajn i Vulic', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, '', 'cigla', ':36:18.5', '', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(349, 'IMS.2.145', 'D(is) M(anibus) | Paridi alu|mno v(ixit) a(nnis) XVII | C. Reg(  ) Callisti|anus PP fecit.', 13, 5, 5, 10, -1, -1, 4, 7, 13, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'beli mermer', '8:59:50', 'Ime Callistianus javlja se u Gornjoj Meziji u Timakum Minusu na grckom jeziku kao Kallistos Jahresh. 6 1903 br 46. U Viminacijumu i drugim mestima u Gornjoj Meziji robovi i oslobodjenici nose uglavnom grcka imena. Ime Paris dosta je cesto pre svega medju glumcima v. Pape Bensler GEN. s.v.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(350, 'IMS.2.146', '. . .A]ur(elius) Vale[. . . | . . .] cohort[is. . .', 16, 5, 5, 10, 26, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'mermer', '2.2:8.2:14.5', 'U drugom redu moglo bi stajati praefectus cohortis ili je mozda u pitanju vojnik neke pomocne jedinice.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(351, 'IMS.2.147', 'D(is) M(anibus) | Aurel(ius) Secun|dinus vet(eranus) | v(ixit) a(nnis) LX Aurelii | Secundina, Secun|dio, Iulia et Lidira | patri b(ene) m(erenti) p(osuerunt).', 13, 5, 5, 10, 33, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'grubi mermer', '3.8:37:32', 'Ime Lidira ili Lidria nije posvedoceno na drugim natpisima.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(352, 'IMS.2.148', 'a)   . . .| a]nnis VI       b)  mil(es) l[eg(ionis) | . . .o]ptio ann(orum) | . . .', 13, 5, 5, 10, 31, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'Dva fragmenta ploce', 'mermer', '2.8:14:10', 'Prvi fragmenat je pronadjen 1973. godine na mestu Velika Kapija dok je drugi cije su dimenzije 2.8 17 10. pronadjen 1978. godine u Kostolcu.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(353, 'IMS.2.149', 'a) L. Pla[. . .]|rius L. [f(ilius) . . ]|us Ga[. . .] | pago R[. . .     b) [. . .natio]|ne Hisp[anus] | vixit ann(is) [. . .] | mil(itavit) an[n(is) . . .', 13, 5, 5, 10, 6, -1, 4, 7, 65, NULL, NULL, NULL, NULL, NULL, NULL, 'dva fragmenta nadgrobne ploce', 'pescar', '11:34:25', 'Dimenzije drugog fragmenta su 11 31 22.5. Pre nego sto im se izgubio trag oba fragmenta su bila prebacena u kolekciju gimnazije u Pozarevcu. Prema misljenju Premerstajna i Vulica u prvom redu prvog fragmenta moglo bi stajati Platorius a u trecem redu tribus Galeria ili origo Gadibus.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(354, 'IMS.2.150', '. . .] | [.Petron]ius | [6] ETER | [vix(it) an]n(is)  LXV | [8]nia | M[a]rcia con|iugi et Petro|nius Cogita|tus, Petronius | Fuscus, Marcia | Marcellina, P[e]|tronius Amyni|anus fili patri | bene merenti | posuerunt.', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'pescar', '22:147:75', 'Ime Amynianus na grckom Amynias dosta je retko. Indeks u CIL III ne navodi cak ni jedan primer.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(355, 'IMS.2.151', 'D(is) M(anibus) | [. . . .] C. Val(erio) Vale(riano) | [10]no VL | [milita]vit an(nos) XVI | [10]RVI f(ilio) ili f(ecit).', 13, 5, 5, -1, 34, -1, 4, 6, 59, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobnog spomenika', '', '::', '', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
