(357, 'IMS.2.153', ']  [. . .]eni vet(erano) [. . .', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'sivi krecnjak', '17:83:70', 'Fragmenat je otkriven u okolini Kostolca prebacen je u Vajfertovu kolekciju u istom gradu nakon cega je nestao.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(358, 'IMS.2.154', '...] [...]us vet(eranus) | [...]ilia [...', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'beli mermer', '3:16:21', 'U drugom redu moglo bi stajati Aemilia filia ili nesto trece. Vulic Jahresh. 15 1912 Beibl. 217 br. 7.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(359, 'IMS.2.155', '1 2 VII C(laudiae) [Ag]|ripa  Vulic.  mozda [p(rae)p(ositus)] ripa[e]  kao CIL III 13814a  ili Ripa [Vim(inacensis)] kao IMS I str. 39.', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'beli mermer', '1.5:14:13', '', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(360, 'IMS.2.156', 'Lupus anemola ic ave|tat. Quot comidi mecum ave[o]. | Ego Maurentia | in hunc mo|numentum | [tit]ulu[m p]osui Lupo | virginio meo cum [q]|uem quinquaginta an|nis beni laboravi adqu[e] | inculpatim covixi et A[r]|genteo Samarconi () fr[a]|tris vel subule(le) m[atri]|s meae ipsum titul[um] feci ().', 13, 5, 5, 10, 18, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'supljikavi zuckasti krecnjak', '54:92:53', 'Tekst je pun vulgarizama anemola za animula deminutiv od anima sa zamenom i sa e i u sa o zatim ic umesto hic avetat umesto habitat comidi umesto comedi beni umesto bene quot umesto quod in hunc monumentum akuzativ umesto ablativa muski rod umesto srednjeg akuzativ quem iza predloga cum subulele umesto subulellae deminutiv od suboles. Ovome treba dodati i genitiv fratris verovatno umesto fratri.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(361, 'IMS.2.157', 'a)  . . . . . . . . | ...i]n terra quam pro[c]ul a patria | Morib(us) et form(a) [a]ariter laudabilis ut quis | Cernere non posset pulchrior an melior. | Nunc [t]umulus super et superset Petronia nomen | Annos bis denos adq(ue) duos tetuli.     b)  . . . . . .m]ari[t]i | Qui caru[i]t vi[t]a quom caret hac anima. | Nec cinerem at terram asportare paternam | quivit et hic miserum ut discruciet stimulus.', 13, 4, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Prema Buheleru natpis potice iz epohe ranog carstva na sta upucuju lepa slova forma pentametra i pojedine reci koje se cesce srecu u periodu ranog carstva na primer tetuli quom umesto cum i discruicare.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(362, 'IMS.2.158', 'D(is) M(anibus) | P. Aelius | Agathopus | vix(it) ann(is) XXXV | Ael(ia) Valentina | uxor b(ene) m(erenti) p(osuit).', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'beli krecnjak', '31:148:87', 'Rec uxor retka je medju epitafima iz Viminacijuma. Moguce je da su u pitanju oslobodjenici jer muz i zena nose isti gentilicij.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(363, 'IMS.2.159', 'a)  D(is) [M(anibus)] | P. Ael(ius) [ . .      b)  ...] | [.]orill [...] | vivus vivis fecit | salvus sis qui | legis.', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', '', '14:80:140', 'Visina drugog fragmenta iznosi 130cm.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(364, 'IMS.2.160', '...] Ael(ius) Meritus | aunculus () o|rum () | E b(ene) m(erentibus) p(osuit).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'donji deo nadgrobne stele', 'krecnjak', '22:64:60', 'Slovo v u reci avunculus verovatno je greskom izostavio kamenorezac.', 'zaKontrolu', 'sara', '2016-01-13', '2016-01-13', 0, 1),
(365, 'IMS.2.161', 'D(is) M(anibus) | Aur(elius) Biruliu|s filius Antioc|ho Suro ca|sum () fecit di|e III Kalend|arum septe|nbrium ().', 13, 5, 5, 10, 35, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'sivi krecnjak', '9:61:32', 'Casum je vulgarna forma reci casam i oznacava grobnicu ili groblje.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(366, 'IMS.2.162', 'D(is) M(anibus) | T. Aurel(Ius) Luci|dus vix(it) ann(is) L | [. . .', 13, 5, 5, -1, 34, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'godnji deo nadgrobne stele', 'krecnjak', ':163:80', '', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(367, 'IMS.2.163', 'D(is) M(anibus) | Aureliae Theodote () | rarissimae femine () | quae vixit annis XXXI m(ensibus) IIII | dies XVII Aur(elius) Gallicus | coniugi bene de se meritae.', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'prednji deo sarkofaga', 'krecnjak', '21.5:200:94', 'Formula bene de se meritae je jedinstvena i javlja se samo na ovom natpisu iz Viminacijuma. Predstave Psihe i Amora jesu personifikacije ljudske duse i nebeske ljubavi v. O. Waser Roscher Lex. III 1897 1909 col. 3247. Upadljiva je slicnost ovog reljefa sa Kapitolinskom grupom v. Roscher loc. cit. fig. 23.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(368, 'IMS.2.164', 'D(is) M(anibus) | L. Barbio L. lib(erto) | Nymphodoto | vix(it) ann(is) XVII | Barbius Del|phicus et| Quarta | parentes | fac(iendum) cur(averunt). | H(ic) s(itus) e(st).', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'beli mermer', '6.5:37.5:24', 'Stela je otkrivena 1892. godine i poklonjena je Narodnom muzeju u Beogradu od strane Vajferta.  Verovatno se radi o oslobodjenicima porodice Barbija iz Akvileje. O ovoj porodici v. J. Sasel Eirene 5 1966 130 sqq. U Singidunumu je posvedocen jedan vojnik Barbius IMS I 6. Kognomen Delphicus je redak. U Saloni CIL III 9103 zabelezena je skracenica DELP koja se moze upotpuniti kao Delphicus. Delphius je rimsko gentilno ime v. Schulze LE 113.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(369, 'IMS.2.165', '[D(is) M(anibus)] | e[t p]er[p]e[tuae] sec|ur[i]ta[ti] Cocceius | Cocceian(us) vix(it) | ann(is) L et Cocc(eia) Sa[bi]na | [v]ix(it) ann(is) V | Aemilia M[. .]a coniux [et] Coc(  ) [. . .', 13, 5, 5, -1, 34, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak ili zuckasti mermer', '::', 'Formula Dis Manibus et perpetuae securitati retka je na natpisima iz Gornje Mezije i veoma cesta u provincijama Panoniji Noriku u Reciji V. IMS I 30. Jedan dekurion iz Marguma pripada porodici Kokceja v. IMS IV 38.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(370, 'IMS.2.166', '[D(is) M(anibus)] | Comi[nio Maio]|ri vixit ann(is) [XX] | Cominia Sa[tur]|nina mater [fi]|lio carissim[o] | memoriam fecit.', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni zrtvenik', 'krecnjak', '27:26:94', 'Identicni gentilicij majke i sina ukazuje na cinjenicu da je sin nezakonit. Kominiji su rasprostranjeni u severnoj Italiji v. Schullze LE 108 i 166. a srecu se i u Gornjoj Meziji u Skupima IMS VI 23 kod jedne pordice poreklom iz Stoba.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(371, 'IMS.2.167', 'D(is) M(anibus) | Q. Cornelius | Q. lib(ertus) Zosimus | vix(it) an(nis) LX | Cornelia Zosime | fil(ia) et Cornelius | Trophimus lib(ertus) | et coher[edes] | fecerun[t]. | H(ic) s(itus) e(st).', 16, 5, 5, 10, 6, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'beli mermer', '20:246:89', 'Imena Zosim i Trofim cesta su kod oslobodjenika v. Mocsy Onomasticon 175. Moguce je da su u pitanju clanovi iste porodice kao IMS II 73. Pored istog gentilnog imena koja se javljaju na natpisima spomenici podsecaju jedan na drugu a sare oko natpisnog polja su iste. Sekira u dnu verovatno simbolizuje vlasnistvo nad grobnicom i garantuje zabranu sahranjivanja bilo koga ko ne pripada porodici preminulog. v. F. De Visscher La droit des tombeaux romains 283 sqq. Sekira se javlja i na spomeniku IMS II 79.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(372, 'IMS.2.168', 'D(is ) M(anibus) | Domitia Pan|thia vix(it) ann(is) | XVIII men(sibus) IIII die(bus) XX | quae sine data | morte mortua | est. Pater pien|tissimus se vi|vi memoriam | posuit filie () pi|entissime () f[ec(it)].', 13, 4, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni zrtvenik ili osnova statue', 'beli mermer', '19:67:34', 'Umesto filie i pientissime trebalo bi da stoji filia i pientissimae v. Mihaescu Langue lat. 184. Memoriam posuit ima znacenje fraze monumentum posuit v. Maric Muzeji 2 1949 173 139. Domiciji su posvedoceni u Kostolcu IMS 24 34 124. Sine data morte mortua est znaci preplasena na smrt mozda za vreme pokusaja ubistva v. Maric. loc. cit.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(373, 'IMS.2.169', '. . .| [10 Eu]sebius MI [2] | P. . .]IRIV civis Germaniceu[s] | ex vico Abdarmisu () qui bixi|t () annus () XXIII. Qui filius pat|ri facere debebat ego IATV.', 13, 5, 5, 10, 26, -1, 4, 7, 61, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'sivi krecnjak', '10:63:41', 'Bixit umesto vixit javlja se i na natpisu IMS II 162. Annus napisano umesto annis verovatno je greska gravera. Qui je napisano umesto quod.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(374, 'IMS.2.170', 'D(is) M(anibus) | T. Fl(avius) Crhestos () | T. Fl(avio) Iuliano filo () ann(ni) I | m(onumentum) p(osuit).', 13, 5, 5, 10, 30, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Spomenik je otkriven u prvoj polovini XVIII veka u Pozarevcu gde je prebacen zajedno sa IMS II 132.', 'zaKontrolu', 'sara', '2016-01-15', '2016-01-15', 0, 1),
(375, 'IMS.2.171', '. .] | M. Iul(ius) P|riscus | fil(ius) et her(es) | m(atri) p(ientissimae) b(ene) m(erenti) p(osuit).', 13, 5, 5, 10, -1, -1, 4, 7, 66, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'pescar', '6:42.5:21.5', '', 'zaKontrolu', 'sara', '2016-01-18', '2016-01-18', 0, 1),
(376, 'IMS.2.172', '....] | [.... vixit] an(nis) LXVI | [...] Iul(ius) Pris|[... pie]ntis[simo, ili simae [....', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'mermer', '5:12:12', '', 'zaKontrolu', 'sara', '2016-01-18', '2016-01-18', 0, 1),
(377, 'IMS.2.173', 'D(is) M(anibus) | Iuliae Procu|[la]e vix(it) an(nis) | [X]I m(ensibus) III d(iebus) II[..] | C. Iul(ius) Hercu[l]|ius et Iu[lia] | Longina | filiae b(ene) m(erenti) p(osuerunt).', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'ploca', 'beli mermer', '2:53:25', 'Moguce je da je zena prethodno bila robinja sto bi objasnilo njeno gentilno ime koje je isto kao i muzevljevo.', 'zaKontrolu', 'sara', '2016-01-18', '2016-01-18', 0, 1),
(378, 'IMS.2.174', 'D(is) M(anibus) | Q. I[u]l(ius) Seneca | vix(it) an(nis) XL | Ulpia() Nigrina [....', 13, 5, 5, -1, 36, -1, 4, 6, 67, NULL, NULL, NULL, NULL, NULL, NULL, 'gornji deo nadgrobnog spomenika', '', ':70:70', 'Ime Seneka rasprostranjeno je u svim provincijama. Kajanto Cognomina 306.', 'zaKontrolu', 'sara', '2016-01-18', '2016-01-18', 0, 1);
INSERT INTO `objekat` (`id`, `oznaka`, `tekstNatpisa`, `vrstaNatpisa`, `jezik`, `provincija`, `grad`, `mesto`, `pleme`, `modernaDrzava`, `modernoMesto`, `ustanova`, `pocetakGodina`, `pocetakVek`, `pocetakOdrednica`, `krajGodina`, `krajVek`, `krajOdrednica`, `tip`, `materijal`, `dimenzije`, `komentar`, `faza`, `korisnickoIme`, `datumKreiranja`, `datumPoslednjeIzmene`, `datovano`, `lokalizovano`) VALUES
(379, 'IMS.2.175', '1 ..nus et G. Iuli[us] Valtrovic  2 NIARCELL.MKI Valtrovic mARCELLinus  CIL  3  NITRI PM P  Valtrovic  maTRI BMP  CIL.', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', '', ':65:77', '', 'zaKontrolu', 'sara', '2016-01-18', '2016-01-18', 0, 1),
(380, 'IMS.2.176', '[...]A XIX | cuius post obitum | Marcianus pudici|tiae v[in]ctus amo|re dicat. | H(oc) m(onumentum) h(eredes) n(on) s(equtur).', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'devet fragmenata nadgrobne stele', 'beli mermer', '3.5:32:25', 'Post obitum predstavlja pocetak heksametra dok puditiciae vinctus amore dicat cini deo pentametra prema Premerstajnu i Vulicu. Dedikant je imao na umu jedan distih. Rec puditiciae cesto se sreca na natpisima sa Krita v. Diehl ILChV br. 294 294a i dr.', 'zaKontrolu', 'sara', '2016-01-18', '2016-01-18', 0, 1),
(381, 'IMS.2.177', 'D(is) M(anibus) | [M]arcus [', 13, 5, 5, 10, -1, -1, 4, 6, 49, NULL, NULL, NULL, NULL, NULL, NULL, '', 'pescar', ':18:62', '', 'nekompletno', 'sara', '2016-01-20', '2016-01-20', 0, 1),
(382, 'IMS.2.178', 'D(is) M(anibus) | Pomp(  )  Fa[', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'gornji deo nadgrobne ploce', 'mermer', '4.5:27:22', 'Premerstajn i Vulic pretpostavljali su da je u pitanju Pompea dok M. Mirkovic smatra da se verovatno radi o osobi muskog pola Pomponius ili Pompeius na primer na sta ukazuje i moguci kognomen Faustus ili slicno.', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(383, 'IMS.2.179', '[D(is) ] M(anibus) | [7 P]roculus | [8] PIPE I |II | [. .', 13, 5, 5, -1, -1, -1, 4, 6, 35, NULL, NULL, NULL, NULL, NULL, NULL, 'gornji desni deo nadgrobnog spomenika', '', '27:123:42', '', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(384, 'IMS.2.180', 'pietati[. . .] | IR Pudenti [. . .] | et Varena [. . .] | Crispinil[l. . .', 13, 5, 5, 10, 18, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'verovatno nadgrobni spomenik', 'beli mermer', '22:58:32', 'Ladek Premerstajn i Vulic smatrali su da je u pitanju licno ime Pietati. M. Mirkovic smatra da bi se ovaj deo teksta mogao rekonstruisati ovako optimae pietatis feminae.', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(385, 'IMS.2.181', 'D(is) M(anibus) | Rufina | Valenti(  ) vix(it) | annis VIIII | Mir(  ) Ruf(i) mat(er) | et Val(  ) Geti (  ) | p(ater) b(ene) m(erenti) f(ecerunt).', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '11:69:57', 'Prema CIL III 8133 ime bi moglo glasiti Rufina Valentini dok bi sesti red mogao glasiti Valentinus Geti. M. Mirkovic dodaje da ne treba odbaciti ni mogucnost rekonstrukcije sa Valentis. Rufina nosi ime po svom dedi sa majicine strane. MIR u petom redu moglo bi biti skracenica od Myrsine Myrtile ili slicno. v. Pape Benseler GEN 250. Prvo od ovih imena cesto je kod oslobodjenika u Dalmaciji v. Alfoldy PND 250. GETI bi se moglo upotpuniti kao Getiani ime koje potice od etniciteta Geta Kajanto Cognomina 108 i 147.', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(386, 'IMS.2.182', 'D(is) M(anibus) | Valeriae | Felicula () | vixit an|nis XXXXV | lib(ertae) et co|niugi L. Val(erius) Euty|chus | b(ene) m(erenti) p(osuit).', 13, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'krecnjak', '24:193:74', 'U imenu Felicula krajnje e je verovatno izostalo omaskom. Felicula inace deminutiv od imena Felix Kajanto Cognomina 124 126 i 273 cesto je kod robova.', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(387, 'IMS.2.183', 'D(is) [M(anibus)] | G. Vale[rius   ] | vixit a[nn(is)    ] | m(ense) I dieb(us) [  ] | CRHESIT V[....', 13, 5, 5, 10, 6, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat stele ili gornja ploca sarkofaga', 'krecnjak', '13:73:83', '', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(388, 'IMS.2.184', 'Ael(ius) Am[   fra]tri  ili  pa]tri', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'beli mermer', '3:9.5:11', 'U prvom redu vidljiva je crta os sloba M na kraju reda. U drugom redu slovo T lici na I.', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(389, 'IMS.2.185', 'Avers  a)   Ta]bula [memoriae  ili  Ta]bula[rium     V A[. . .       b) . . . .N    Revers  a) 1 IA ili TA na kraju reda 2 IOIA MBVI mozda totam ab vi[ta 3 verovatno , ,me]moriam fe[cit  ili  cerunt sa moyda pogresnom ligaturom MA na pocetku reda 4 . . .]us patri sa dekorativnim znakom na kraju reda 5 . . .]to mozda sancto sa ornamentom u obliku srca na kraju.', 16, 5, 5, 10, 26, -1, 4, 7, 68, NULL, NULL, NULL, NULL, NULL, NULL, 'dva fragmenta ploce', 'plavicasti mermer', '2.5:16.5:23', 'Dimenzije drugog fragmenta su 1.8 13.5 16.', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(390, 'IMS.2.186', '[D(is)] M(anibus) | [4]iano | [3 S]crib(oniae) | [3]ninae vi[x(it) | ann(is) ] . . .   Vulic.', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobne stele', 'beli mermer', '4:20:10.5', '', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
(391, 'IMS.2.187', '[D(is)] M(anibus) | [. .]illa PR[. .] | [. .]ius c[on(iugi)] [. .', 13, 5, 5, 10, 26, -1, 4, 7, 61, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobne stele', 'krecnjak', '9:27:30', '', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
