(393, 'IMS.2.189', '1 D(is) [M(anibus)   2 Nige[r]', 13, 5, 5, 10, 37, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobne ploce', 'beli mermer', '3.3:13:10', '', 'zaKontrolu', 'sara', '2016-01-25', '2016-01-25', 0, 1),
