(420, 'IMS.2.216', 'Cristus () deus dei | filius custodiat | artefices () om|nes qui hoc | [o]pus fecerunt | in domino.', 12, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, '', 'opeka', '2.5:41:55', 'Umesto artefices trebalo bi da stoji artifices.', 'zaKontrolu', 'sara', '2016-01-26', '2016-01-26', 0, 1),
(421, 'IMS.2.217', 'Marina honis|ta () femina cultrix | di () q(uae) vixit cum virgi|nio suo an(nis) XXX P. Licin(io) | Cosanciolo () sita es ().', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, 4, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'mermer', '2:36:56', 'Na IV vek upucuju kurzivna slova. Natpis je hriscanski. Za formulu honesta femina v. Diehl ILChV br 301 i dr. Cultrix dei javlja se i na drugim hriscanskim natpisima v. Diehl br 14 2477 1049 i dr.', 'zaKontrolu', 'sara', '2016-01-26', '2016-01-26', 1, 1),
(422, 'IMS.2.218', 'SIIIIA quae qui|escit in pace | Romae ABI|DVA ann(orum) XLV | deposita (ante diem) VI | Id(us) Feb(ruariuas).', 13, 5, 5, 10, 26, -1, 4, 7, 70, NULL, NULL, NULL, NULL, NULL, NULL, 'deo nadgrobnog spomenika', 'opeka', '5:41:41', 'Opeka je otkrivena 1979. godine zajedno sa drugim opekama iz grobnica nekropole u blizini Kostolca. SIIIIA bi verovatno trebalo citati kao Sitha. Romae u trecem redu verovatno predstavlja lokativ.', 'zaKontrolu', 'sara', '2016-01-26', '2016-01-26', 0, 1),
(423, 'IMS.2.219', 'Grcki tekst. Valer(ius) [meo Theodu|lo. Haec [memoria] | quidem me[a, tua autem laus.] | Discant igit[ur pueri] | nutritores a[mare. Gratiam habeo ti]|bi vivus et qu[iescens in perpetuum.]', 13, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna ploca', 'beli mermer', '4:40:45', '', 'zaKontrolu', 'sara', '2016-01-26', '2016-01-26', 0, 1),
