(425, 'IMS.2.222', 'Grcki tekst', 11, 4, 5, 10, 26, -1, 4, 7, 69, NULL, NULL, NULL, NULL, NULL, NULL, '', 'opeka', '4.5:41:28', '', 'zaKontrolu', 'sara', '2016-01-27', '2016-01-27', 0, 1),
(426, 'IMS.2.224', 'Ave domine | Lumen meum.', 17, 4, 5, 10, 26, -1, 4, 7, 61, NULL, NULL, NULL, NULL, NULL, NULL, 'okruglasti predmet', 'terakota', '::', 'Domina je cest termin u Poznom carstvu i pripisuje se razlicitim bozanstvima cf. Diz. ep. s.v. Dominus. Termin je posvedocen i na hriscanskim natpisima npr. Domina de sanctis martyribus Diehl ILChV br. 1825 cf. 1842 i 2115. Domina coniux AE 1975 br. 37. Lumen se javlja i na natpisu IMS II 113 kao na natpisima iz hriscanske epohe Diehl ILChV br. 1965.', 'zaKontrolu', 'sara', '2016-01-27', '2016-01-27', 0, 1),
(427, 'IMS.2.225', 'a)  C. Iul(ii) Iuniani diab()|sor(icum) ad aspr(i)t(udinem) et cla(ritatem).      b)  C. Iul(ii) Iunian(i) croc|od(es) asp(ritudinis).', 17, 4, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'pecat', 'crni kamen', '::', 'Gaj Julije Junijan nije poznat na osnovu drugih izvora. Gentilno ime Julija cesto se srece na predmetima ove vrste cf. CIL XIII 10021 i indeks. Ya ime Junijan vidi Kajanto Cognomina 32 i 148.', 'zaKontrolu', 'sara', '2016-01-27', '2016-01-27', 0, 1),
(428, 'IMS.2.223', 'Fidem D(omino) n(ostro) Constanti Augusto n(ovo) a(nno).', 17, 4, 5, 10, -1, -1, 4, 7, 60, NULL, NULL, NULL, NULL, NULL, NULL, 'prsten', 'zlato', '::', 'Car je prstenje delio svojim visokim civilnim i vojnim funkcionerima u odredjenim prilikama. cf. R. Mowat Memoires 50 1889 332 sqq.', 'zaKontrolu', 'sara', '2016-01-27', '2016-01-27', 0, 1),
(429, 'IMS.2.226', 'Grcki tekst', 17, 4, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'okruglasti predmet', 'staklo', '::', 'Tezina predmeta iznosi 321.5 grama skoro jednu rimsku funtu libra 327.46 grama.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(430, 'IMS.2.227', 'Gesubalu () | Bitus q(ui) | exibit () | latere () numeru () | CCCII.', 17, 4, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na opeki', 'opeka', '5:41:30', 'Gesullacu  Vulic. Gesubalu  Petrovic. Moguce je da je u pitanju dacko ime prema analogiji sa Decebalus. Pomenuto ime verovatno ima isti koren kao i tracko ime Gesienos v. Detschew Thr. Sprach. 103. Ime Bitus trackog je porekla v. Detschew op. cit. 66. Broj CCCII verovatno upucuje na broj cigala koje je proizveo Gesubalus Bitus. Broj je znatno veliki ukoliko se poredi sa ostalim ciframa zabelezenim na drugim mestima npr. CIL III 11378 do 11386 iz Siscije gde se pominju brojevi CCXX i CLXIII. Cf. takodje cifru LXXV na cigli legije IIII Cuppis iz Viminacijuma Jahresh. 8 1905 Beibl. 9 br. 29.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(431, 'IMS.2.228', 'Invidi () qui | I livis hoc ca|cafis () anus | eris', 17, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na opeki', 'opeka', ':28.5:27', 'Reci invidus liveo i caco ceste su na slicnim natpisima cf. J. Marcillet Jaubert Epigraphica 37 1975 153 sqq. V. na primer curiosos pedico invide cacas ili omnibus invideas livide nemo tibi H. I. Marrou Bull. Archeol. Alger. III 1968 349 sqq.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(432, 'IMS.2.229', 'Lucius Valerius | Cretus Papiria | [l]at(eres) cusit()  e Ratiaria.', 17, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'cev', 'terakota', '27:9:12', 'Sirina cevi sa unutrasnje strane iznosi 24 cm. Cusit bi trebalo cuitati kao coxit. Za prelazak u u o i cs u s v. Mihaescu Langue lat. 178 i 203. Ime Cretus verovatno je izvedeno od glagola cresco cf. Kajanto Cognomina 351. Papiria je bila triba Racijarije Kubitschek IRT 238. Ladek Premerstajn i Vulic smatrali su da je Lucije Valerije Kret bio vojnik legije VII Claudia. Ta pretpostavka je bez osnova.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(433, 'IMS.2.230', 'Euphoniu[s]   Vulic.', 17, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na opeki', 'opeka', ':45:16.2', 'Visina opeke oscilira od 45 do 27. Tekst je napisan kurzivnim pismom.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(434, 'IMS.2.231', 'Leg(io) VII Cl(audia).', 17, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na opeki', 'opeka', '3.5:41:28', '', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
