(436, 'IMS.2.233', 'Grcki teskt.', 17, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na opeki', 'opeka', '::', 'U pitanju je grcko ime Hilaros sa latinskim zavrsetkom na us.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(437, 'IMS.2.234', 'Grcki tekst.', 17, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na opeki', 'opeka', ':24:18', '', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(438, 'IMS.2.235', 'Grcki tekst.', 17, 5, 5, 10, 30, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'natpis na opeki', 'opeka', ':52.5:54', 'Pored natpisa na opeki su urezane figure golog coveka sa bradom i tri zivotinje verovatno vepra bika i lisice.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
(439, 'IMS.2.236', 'a) . . .]nu[s]   . . .] | [. . .]cianu[s]   M. Aur(elius) I[. . .] | [. . .]enus    M. Aur(elius) F[. . .] | [. . .]nus   M. Ulp(ius) [. . .] | [. . .]itanus   C. Iul(ius) [. . .            b) I ND', 16, 5, 5, 10, -1, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'belo crvenkasti mermer', '3.9:13.5:18', 'Fragmenat je otkriven 1976. godine u Cairu. Verovatno je u pitanju lista vojnika ili pripadnika nekog kolegija.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
