(441, 'IMS.2.238', 'Vet]uriis. . . . . [ Eu  ili  Agarh|ang]elo Ge[nti]a[no] . . . | . . na[e]   CCC. FFF (Gaius Flaviis tribus) [Re]s[t]i[tuto | Fr]onton[i] e[t] Filocrat[i | et] CCC [FFF.]  (Gaius Flaviis tribus) Fi[l. . .   Ladek Premerstajn Vulic.', 16, 5, 5, 10, -1, -1, 4, 6, 59, NULL, NULL, NULL, NULL, NULL, NULL, 'donji deo spomenika', 'krecnjak', '::', 'Na pocetku natpisa se mozda nalazi slovo V ili N dok se u trecem redu nakon FFF mozda nalazi slovo P ili R. Na pocetku petog reda izdavaci pretpostavljaju slovo C.', 'zaKontrolu', 'zarko', '2016-02-01', '2016-02-01', 0, 1),
