(495, 'IMS.2.292', 'Grcki teskt.', 16, 5, 5, 10, -1, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'krecnjak', '8:60:39', 'Prema Vulicu na natpisu su bila ispisana muska imena u genitivu cije znacenje ostaje nejasno.', 'zaKontrolu', 'zarko', '2016-02-10', '2016-02-10', 0, 1),
(496, 'IMS.2.293', 'I(ovi) O(ptimo) M(aximo) | vexil(latio) leg(ionis) | VII Cl(audiae) | [sub] cura | G. Licin(i) Rufini (centurionis).', 11, 5, 5, 10, 41, -1, 4, 7, 72, NULL, NULL, NULL, NULL, NULL, NULL, 'tabula ansata', 'kamen', ':109:60', 'Verovatno je jedna veksilacija legije iz Viminacijuma koja je gradila put isla ka Lederati i utvrdjenju na levoj obali Dunava. U tom slucaju natpis se moze datovati u kraj I ili pocetak II veka kada se Trajan spremao za rat sa Dacanima. v. Intr. 38.', 'zaKontrolu', 'zarko', '2016-02-10', '2016-02-10', 0, 1),
(497, 'IMS.2.294', '. . .] dec(urio) mun(icipii) [3] | [3] frater et her[es] | b(ene) m(erenti).', 13, 5, 5, 10, 41, -1, 4, 7, 72, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat nadgrobnog spomenika', 'beli mermer', ':42:31', 'Moguce je da je u natpisu stajalo decurio municipii Viminacii.', 'zaKontrolu', 'zarko', '2016-02-10', '2016-02-10', 0, 1),
(498, 'IMS.2.295', 'D(is)  M(anibus) | P. Ceionio Rufo ann(orum) VIII | filio dulcissimo et | Petissenae Magnae | ann(orum) XXVIII men(sium) III con|iugi karissimae P. Ceionius Eunus | fecit.', 13, 5, 5, 10, 42, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', '', '::', 'Cejoniji su brojni na natpisima iz Dalmacije posebno Alvone i Salone. Alfoldy PND 74. Neki su oslobodjenici sa grckim imenima CIL III 8976.  Petissenus je italsko ime Schultze LE 208 i u balkanskim provincijama se javlja samo na ovom natpisu. Grcko ime Eunus je takodje retko. CIL III pored ovog primera pominje jos jedan neizvestan iz Makedonije CIL III 12300.', 'zaKontrolu', 'zarko', '2016-02-10', '2016-02-10', 0, 1),
(499, 'IMS.2.296', '. . .] | Tib. Cl(audius) Valen[s] | vet(eranus) leg(ionis) VI[I Cl(audiae)] | vixit a(nnis) X[. . .', 13, 5, 5, 10, 41, -1, 4, 7, 73, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobni spomenik', 'krecnjak', '22:25:79', 'Kamen je mozda donet iz Viminacijuma kao i IMS II 294 ili je u pitanju veteran legije koja je stacionirana u Viminacijumu a koji se nastanio u blizini ramskog utvrdjenja.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(500, 'IMS.2.297', 'IDAVNI | Apollin(i) | Q S Dian|a(e) Silvano | Ael(ius) Vale|ntinus | II vir col(oniae)  | v(otum) l(Ibens) p(osuit).', 11, 5, 5, 10, 43, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'supljikavi krecnjak', '25:56:25', 'U pitanju je duovir kolonije Viminacijum. O pomenu Apolona Dijane Silvana i drugih bozanstava na jednom mestu cf. Vaglieri Diz. ep. I 1895 col. 514 i Cesano ibid. col. 1746.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(501, 'IMS.2.298', 'Deo [. . .] | MER () S[. . .', 11, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'gornji deo zrtvenika', 'supljikavi pescar', '23:25:21', '2  Mercurio sacrum  Ladel Premerstajn Vulic. Slovo R je neizvesno. Moguce je i da je u pitanju ime dedikanta.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(502, 'IMS.2.299', 'Mart(i) | sac(rum) | T. F(lavius) Sapi(  ) | ex viso ().', 11, 4, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'pescar', '33:58:44', '3   T. Flavius Sapiens   Vulic. Na slovima su bili vidljivi tragovi crvene boje. Ex viso ili ex visu je formula za posvetu bozanstvu po snovidjenju iz kojeg se doznalo da bozanstvo hoce dar. O kolebanju dveju formi cf. V. Nedeljkovic Lucida intervalla 43 2014 91 93.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(503, 'IMS.2.300', 'Sil(vano) | sac(rum) | Dom(estico).', 11, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'pescar', '33:64:39', 'Na slovima su vidljivi tragovi crvene boje. Silvan je u Dalmaciji smatran kao interpretatio Romana ilirskog bozanstva suma cf. Domaszewski Religion 53. C. Patsch Festschrift O. Hirschfeld 1903 202. D. Rendic Miocevic Glasnik ZMS 10 1955 5 sqq za spomenike posvecene Silvanu u Dalmaciji. Silvan je svuda poznat kao zastitnik kuce Wissowa Religion 176. R. Peter Roscher Lex. s.v. col. 850 sqq. Cf. IMS II 310.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(504, 'IMS.2.301', 'DO C[I] | VN[I]A | [O] NVMINI | EIVS', 11, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '::', 'Na kraju verovatno numini maiestatique eius.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(505, 'IMS.2.302', '6   le]g VII   Ladek Premerstajn Vulic.   7   coniu]gi .', 16, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat cilindricnog spomenika', '', ':60:92', '', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(506, 'IMS.2.303', '. . .] | vixit an(nis) | LXXX M. Ul|pius Surio | matri pientis|sime () pos(uit).', 13, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'donji deo nadgrobnog spomenika', 'krecnjak', '27:98:91', 'Spomenik je otkriven krajem XIX veka na lokaciji Gradac kod sela Kaliste. Ime Surio cesto je u trackim zemljama Detschew Thr. Sprachr. 371 u Iliriji Mayer Ill. Sprache 326. O difuziji imena u Dardaniji cf. Papazoglu Triber 235 i 239.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(507, 'IMS.2.304', '. . .s co[i]u[x] ili co[i]u[gi | vixit] m(inus) pl(us) [annis] L   Vulic.', 13, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'verovatno fragmenat nadgrobne ploce', 'pescar', '57:53:39', '', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(508, 'IMS.2.305', 'IVF', 16, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'cipus', 'krecnjak', '60:32:52', 'Cipus je pronadjen krajem XIX veka u Gradcu kod sela Kaliste.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(509, 'IMS.2.306', '. . .VN | . . .ICAN', 16, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'mermer', '2:20.5:15', 'Fragmenat je otkriven 1897. godine u Gradcu kod sela Kaliste.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(510, 'IMS.2.307', 'Jovinus.', 17, 5, 5, 10, 43, -1, 4, 7, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'teg u obliku cilindra', 'bronza', ':24:35', 'Tezina tega je 164.7 gr.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(511, 'IMS.2.308', 'Deo Invi|cto Mitr(ae) () | G. Iul(ius) Val(ens) ve|t(eranus) leg(ionis) VII Cl(audiae) | ex b(ene)f(iciario) co(n)s(ularis) | nunc dec(urio) | Vim(inacii) temp(lum) | a solo re|fecit.', 11, 5, 5, 10, 13, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'beli mermer', '28:88:34.5', 'Zrtvenik je otkriven oko 1890. godine. Spomenici posveceni Mitri u Viminacijumu IMS II 29 34.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(512, 'IMS.2.309', 'Deo Hero[ni | VPONSVS ().', 11, 5, 5, 10, 44, -1, 4, 7, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat osnove', 'beli mermer', '5:8.1:9', 'Heron je tracko bozanstvo posvedoceno i na drugim spomenicima iz Gornje Mezije IMS II 16 221. Obicno je predstavljeno kao konj. Tragovi stopala na osnovi verovatno pripadaju Heronovom pratiocu.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(513, 'IMS.2.310', 'Silva(no) dom(estico) | EGNIM    Vulic.', 11, 5, 5, 10, -1, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '12:56:24', 'Za Silvana Domestika zastitnika ognjista cf. R. Peters Roscher Lex. III 1902 1909 col. 850. Za primere sa teritorija bivse Jugoslavije v. Maric Kultovi 59 i za Dalmaciju D. ReNdic Miocevic Glasnik ZMS 10 1955 7 sqq. Cf. natpis iz Kalista IMS II 300.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(514, 'IMS.2.311', 'Grcki tekst.', 13, 4, 5, 10, -1, -1, 4, 6, 35, NULL, NULL, NULL, NULL, NULL, NULL, 'nadgrobna stela', 'krecnjak', '21:106:74', 'Zensko ime Epiktesis i muska imena Nikijas i Nikon rasprostranjena su svuda.', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(515, 'IMS.2.312', 'Grcki tekst.', 13, 5, 5, 10, -1, -1, 4, 6, 35, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat spomenika', 'krecnjak', '30:148:50', '', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(516, 'IMS.2.313', 'Grcki tekst.', 16, 5, 5, 10, -1, -1, 4, 6, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat ploce', 'beli mermer', '7:28:20', '', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(517, 'IMS.2.314', 'Grcki tekst.', 16, 5, 5, 10, -1, -1, 4, 6, 35, NULL, NULL, NULL, NULL, NULL, NULL, 'fragmenat spomenika', 'krecnjak', '32:45:39', '', 'zaKontrolu', 'zarko', '2016-02-16', '2016-02-16', 0, 1),
(518, 'IMS.4.1', 'Attae | sacr(um) | Melio|ris | v(otum) s(olvit).', 11, 5, 5, 12, -1, -1, 4, 8, 75, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'zelenkasti pescar', '17:62:24', 'Zrtvenik je otkriven 1955. godine. Posvecen je verovatno lokalnom bozanstvu Ati. Naziv Atta javlja se i na drugim spomenicima ali ne kao naziv bozanstva vec kao kognomen  IMS I 38 IMS IV 7 CIL III 9176. Pretpostavlja se da je poreklo imena keltsko cf. G. Alfoldy Epigr. Studien 4 1967 10 sq. A. Mocsy Die Bevolkerung von Pannonien bis zu den Markomannenkriegen 1959 165.  Ime dedikanta Melior je cesto.', 'zaKontrolu', 'zarko', '2016-05-27', '2016-05-27', 0, 1),
(519, 'IMS.6.15', '[. . .] L. f(ilius) Pub(lilia) RE | [4] Verona CON | [de]curio quaestor II v(i)r | [col(oniae) Fl(aviae) ()] fel(icis) Dar(danorum) hoc t(em)pl(um) | [impe]nsa sua fac(iendum) c(uravit) | [D]eae Syriae.', 12, 4, 5, 13, 45, -1, 7, 16, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'tabula ansata', 'mermer', '::', 'Mermerna ploca je otkrivena 1948. godine zajedno sa zrtvenikom IMS.6.16.  Ovaj natpis je od izuzetne vaznosti jer nam dopunjava skracenicu col. F. F. D posvedocenu na drugim natpisima IMS VI 42 i IMS VI 46. Pre toga se smatralo da poslednje slovo u nazivu kolonije oznacava ime cara Domicijana na osnovu cega se zakljucivalo da je pomenuti car osnovao koloniju u Skoplju v. AE 1910 173 gde je skracenica razresena ovako Flavia felix Domitiana. Otkricem ovog natpisa ostavlja se otvoreno pitanje da li je osnivac kolonije bio Domicijan ili Vespazijan sto se cini verovatnijim v. IMS VI Intr. 25 26. E. Birley The Flavian colonia at Scupi ZPE 64 1986 209 2016. Pored samog naziva grada natpis je znacajan i zbog toga jer otkriva postojanje hrama znacajne sirijske boginje u Skoplju. Najverovatnije je rec o boginji Atargatis koja je u latinskim zemljama bila poznata kao Dea Syria. v. Cumont Les regions orientales 95 sqq. I. Cesano Diz. ep. II 1467 sqq.', 'zaKontrolu', 'zarko', '2016-05-30', '2016-05-30', 0, 1),
(520, 'IMS.4.2', '[D(is)]  DEABUS | . . PLACIDI F NI|. . VLP LAETVS| . . EX VOTO PRO | . . LIB P', 11, 4, 5, 12, -1, -1, 4, 8, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'zelenkasti pescar', '17:62:24', 'Spomenik je otkriven 1553. godine u Nisu ugradjen u zid karavan saraja yajedno sa spomeniko IMS IV 17. Formula dis deabus uobicajena je za posvete velikim bozanstvima kao sto su Jupiter ili Junona. U Nisu su posvedocena jos dva primerka IMS IV 62 IMS IV 101. Up. CIL III 8186 Skupi i Spomenik LXXXI 1931 br. 96 Vucitrn. Filijacija koja se odnosi na kognomen oca Placidi filius je retka ali ipak posvedocena i na drugim mestima. Slova na kraju reda mozda ukazuju na kognomen na primer Anicetus Animus ili drugo. U poslednjem redu skracenica se moze rekonstruisati kao libentes posuerunt CIL III 1673.', 'zaKontrolu', 'zarko', '2016-06-28', '2016-06-29', 0, 1),
(521, 'IMS.4.3', 'Domn(ae) Re[g(inae)] | et Domno et | Bono Evento () | pro s(alute) Aug(usti) | Ulp(ius) Martinus s(trator) | c(onsularis) l(egionis) VII C(laudiae) S(everianae) Alex(andrianae) | v(otum) p(osuit) l(ibens) m(erito).', 11, 5, 5, 12, -1, -1, 4, 8, 19, 222, 3, 'prva polovina', 235, 3, 'prva polovina', 'zrtvenik', 'krecnjak', '31:53:37', 'Ulpije Martin je verovatno ista osoba koja se javlja na jos jednom natpisu iz Nisa IMS IV 14 gde je oznacen kao konzul za 225. godinu. Stratores consularis kao dedikanti javljaju se i na drugim natpisima IMS IV 7 8 9 11 i verovatno IMS IV 13. Njihova uloga u Nisu nije najjasnija. Moguce je da su radili u radionicama za popravku vojne opreme ili na ergelema. Legija VII Claidiae imala je stalni logor u Viminacijumu. Naziv legije Severiana Alexandriana posvedocen je i za prvu legiju na natpisu iz 234. godine v. IMS IV 101.', 'zaKontrolu', 'zarko', '2016-06-29', '2016-06-29', 1, 1),
(522, 'IMS.4.4', 'Deae Fortunae | pro s(alute) d(ominorum) n(ostrorum duorum) | [Aug(usti) e]t [Caes(aris)] | Elius () Flavius | Restutus | s(ua) p(ecunia) | [Gr]ato et Seleuco () co(n)s(ulibus) | [A]urel(ius) Dexter | sacerdos P I M P [  ].', 11, 5, 5, 12, -1, -1, 4, 8, 19, 221, 3, 'prva polovina', NULL, NULL, NULL, 'zrtvenik', 'pescar', '43:84:45', 'Natpisi na zrtvenicima IMS IV 9 i 11 takodje su posveceni carevima Elagabalu i Aleksandru Severu. Aurelije Dekster je mozda svestenik u Fortuninom hramu.', 'zaKontrolu', 'zarko', '2016-06-29', '2016-06-29', 1, 1),
(523, 'IMS.4.5', 'Deae Iunon(i) | Atil(ius) Felicia|nus v(otum) p(osuit).', 11, 5, 5, 12, -1, -1, 4, 8, 75, NULL, NULL, NULL, NULL, NULL, NULL, 'zrt', 'sivi krecnjak', ':41:25', '', 'zaKontrolu', 'zarko', '2016-09-20', '2016-09-20', 0, 1),
(524, 'IMS.4.6', 'I(ovi) O(ptimo) F(  ) M(aximo) | Capitolino | ex boto () p(osuerunt) | Nica Herme[s] | pro salute | domini no|stri [ . . .', 11, 5, 5, 12, -1, -1, 4, 8, 19, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', '', '::', 'Zrtvenik je otkriven 1553. godine u Nisu.', 'zaKontrolu', 'zarko', '2016-09-20', '2016-09-20', 0, 1),
(525, 'IMS.4.7', 'I(ovi) O(ptimo) M(aximo) | pr(o) s(alute) d(omini) n(ostri) | Aug(usti) T. Aur(elius) | Atta mil(es) | leg(ionis) IIII Fl(aviae) str(ator) co(n)s(ularis) | pos(uit).', 11, 5, 5, 12, -1, -1, 4, 8, 75, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '30:68:40', '', 'zaKontrolu', 'zarko', '2016-09-20', '2016-09-20', 0, 1),
(526, 'IMS.4.8', 'I(ovi) O(ptimo) M(aximo) | pro s(alute) d(omini) n(ostri) Aug(usti) | M. Aur(elius)  Gaius | mil(es) leg(ionis) VII Cl(audiae) | strat(or) co(n)s(ularis) v(otum) s(olvens) l(ibens) m(erito) p(osuit) | [i]mp(eratore) [[6]] et Comazon(te) [co(n)s(ulibus)].', 11, 5, 5, 12, -1, -1, 4, 8, 75, 220, 3, 'prva polovina', NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '30:75:37', 'Zrtvenik je otkriven 1887. godine u Nisu.', 'zaKontrolu', 'zarko', '2016-09-20', '2016-09-20', 1, 1),
(527, 'IMS.4.9', 'I(ovi) O(ptimo) M(aximo) | pro sa[l(ute)] d(ominorum) | n(ostrorum) Aug(ustorum duorum) | Aur(elius) Gaius | mil(es) leg(ionis) VII | str(ator) co(n)s(ularis) | pos(uit).', 11, 5, 5, 12, -1, -1, 4, 8, 19, 221, 3, 'prva polovina', 222, 3, 'prva polovina', 'zrtvenik', '', '::', 'Spomenik je otkriven 1553. godine u Nisu.', 'zaKontrolu', 'zarko', '2016-09-20', '2016-09-20', 1, 1),
(528, 'IMS.4.10', 'I(ovi) O(ptimo) M(aximo) | M. Aur(elius) Po|sidonious dec(urio) m(unicipii) N(aissi) | v(otum) p(osuit).', 11, 5, 5, 12, -1, -1, 4, 8, 75, NULL, NULL, NULL, NULL, NULL, NULL, 'zrtvenik', 'krecnjak', '42:100:52', 'Nis je municipalni status stekao najverovatnije u vreme Marka Aurelija.', 'zaKontrolu', 'zarko', '2016-09-20', '2016-09-20', 0, 1);
